otberuf Digitalisierungsberater.\",\"username\":\"Kraemer_HB\",\"profile_image_url\":\"https://pbs.twimg.com/profile_images/1378870666116673541/31AVP90A_normal.jpg\",\"public_metrics\":{\"followers_count\":1015,\"following_count\":828,\"tweet_count\":14566,\"listed_count\":17},\"url\":\"https://t.co/zlEz16tmmV\",\"created_at\":\"2017-02-01T18:35:20.000Z\",\"location\":\"Bremen\",\"id\":\"826861508613328906\",\"name\":\"Matthias Krämer\",\"verified\":false}],\"tweets\":[{\"conversation_id\":\"1403638478580105218\",\"lang\":\"de\",\"id\":\"1403638478580105218\",\"public_metrics\":{\"retweet_count\":81,\"reply_count\":18,\"like_count\":434,\"quote_count\":1},\"author_id\":\"2285678941\",\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"}]},\"text\":\"#IchbinHanna! Ich studiere ökologische Menstruationswissenschaft. In meiner Freizeit hüpfe ich für's Klima und hasse Männer. Gebt mir Geld!\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T09:01:06.000Z\"},{\"conversation_id\":\"1403009195448881153\",\"lang\":\"de\",\"id\":\"1403009195448881153\",\"public_metrics\":{\"retweet_count\":1,\"reply_count\":1,\"like_count\":6,\"quote_count\":0},\"author_id\":\"2966107887\",\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"}]},\"text\":\"#IchbinHanna Mein Vertrag als Post-Doc läuft in 2023 aus. Ich glaube nicht mehr daran, dass ein Wunder passiert und eine unbefristete Stelle vom Himmel fällt. Ich liebe meinen Job aber ich werde die 2 Jahre dafür nutzen, einen Platz außerhalb der Wissenschaft für mich zu finden.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T15:20:33.000Z\"},{\"conversation_id\":\"1403825792669335554\",\"lang\":\"de\",\"id\":\"1403825792669335554\",\"public_metrics\":{\"retweet_count\":306,\"reply_count\":30,\"like_count\":1392,\"quote_count\":48},\"author_id\":\"258353673\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":190,\"end\":202,\"tag\":\"IchbinHanna\"}]},\"text\":\"Hallo, ich bin Jens (45) und bin mit 31 Jahren W3-Prof für VWL geworden. Ich kenne das akademische up-or-out game (bzw. die upside) also ganz gut aus eigener Erfahrung. \\nIch unterstütze das #IchbinHanna Anliegen und würde es gerne etwas einordnen. /Thread\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T21:25:25.000Z\"},{\"conversation_id\":\"1402949567558131714\",\"lang\":\"de\",\"id\":\"1402949567558131714\",\"public_metrics\":{\"retweet_count\":47,\"reply_count\":1,\"like_count\":180,\"quote_count\":3},\"author_id\":\"1272078080241217544\",\"entities\":{\"urls\":[{\"start\":251,\"end\":274,\"url\":\"https://t.co/UczaTWX62M\",\"expanded_url\":\"https://www.bmbf.de/de/media-video-16944.html\",\"display_url\":\"bmbf.de/de/media-video…\",\"images\":[{\"url\":\"https://pbs.twimg.com/news_img/1402590778543722496/xFefjQWc?format=jpg&name=orig\",\"width\":684,\"height\":385},{\"url\":\"https://pbs.twimg.com/news_img/1402590778543722496/xFefjQWc?format=jpg&name=150x150\",\"width\":150,\"height\":150}],\"status\":200,\"title\":\"Wozu dient das Wissenschaftszeitvertragsgesetz? - BMBF\",\"description\":\"Erklärfilm zum Wissenschaftszeitvertragsgesetz\",\"unwound_url\":\"https://www.bmbf.de/de/media-video-16944.html\"}],\"hashtags\":[{\"start\":6,\"end\":18,\"tag\":\"IchbinHanna\"}]},\"source\":\"Twitter Web App\",\"text\":\"Unter #IchbinHanna beschreiben grad Wissenschaftler:innen ihre prekären Arbeitsbedingungen. Grundlage dafür ist dieses (alte) Erklärvideo @BMBF_Bundm. Fazit: Wer es nicht zum Prof. schafft, ist selbst schuld und \\\"verstopft\\\" nur das System. Unsäglich. https://t.co/UczaTWX62M\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T11:23:37.000Z\"},{\"conversation_id\":\"1403030447723106310\",\"lang\":\"de\",\"id\":\"1403030447723106310\",\"public_metrics\":{\"retweet_count\":254,\"reply_count\":105,\"like_count\":1734,\"quote_count\":29},\"attachments\":{\"media_keys\":[\"3_1403030444157935619\"]},\"author_id\":\"98178963\",\"entities\":{\"urls\":[{\"start\":264,\"end\":287,\"url\":\"https://t.co/40Q2OhKo7k\",\"expanded_url\":\"https://twitter.com/schorn_stephan/status/1403030447723106310/photo/1\",\"display_url\":\"pic.twitter.com/40Q2OhKo7k\"}],\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchBinHanna\"}]},\"source\":\"Twitter for Android\",\"text\":\"#IchBinHanna, 31, und studiere im 26. Semester Soziologie mit Schwerpunkt \\\"Faschistische Strukturen unter rudelbildenden Schildkröt*innen während der Kreidezeit\\\".\\n\\nIch verstehe nicht, warum meine Forschung den Menschen nicht mehr wert ist als ein Zeitvertrag \\uD83E\\uDD37‍♂️ https://t.co/40Q2OhKo7k\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T16:45:00.000Z\"},{\"conversation_id\":\"1403740039188824065\",\"lang\":\"de\",\"id\":\"1403740039188824065\",\"public_metrics\":{\"retweet_count\":16,\"reply_count\":0,\"like_count\":224,\"quote_count\":1},\"author_id\":\"1319674862995181569\",\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":258,\"end\":270,\"tag\":\"IchbinHanna\"}]},\"text\":\"Ich war Hanna (Physik studiert, fertig promoviert mit 28) dann 8 Jahre Postdoc auf befristeten Verträgen. Seit 5 Jahren nun unbefristete W2 Stelle und ich bin nun deutlich kreativer. Kreativität und Innovation haben viel mit Unabhängigkeit und Fokus zu tun. #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T15:44:40.000Z\"},{\"conversation_id\":\"1403684093984923648\",\"lang\":\"de\",\"id\":\"1403684093984923648\",\"public_metrics\":{\"retweet_count\":15,\"reply_count\":3,\"like_count\":69,\"quote_count\":0},\"author_id\":\"114774406\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403637440875794432\"}],\"entities\":{\"urls\":[{\"start\":86,\"end\":109,\"url\":\"https://t.co/O5xKJMmLrT\",\"expanded_url\":\"https://twitter.com/Die_Gruenen/status/1403637440875794432\",\"display_url\":\"twitter.com/Die_Gruenen/st…\"}],\