il Du sie für 2 Jahre statt der üblichen 6Monate einstellen wolltest ...dann ist die next generation #IchbinHanna vorprogrammiert... #95WissZeitVG\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T15:38:41.000Z\"},{\"conversation_id\":\"1403081616667385857\",\"lang\":\"de\",\"id\":\"1403081616667385857\",\"public_metrics\":{\"retweet_count\":122,\"reply_count\":9,\"like_count\":914,\"quote_count\":5},\"attachments\":{\"media_keys\":[\"3_1403081606307495936\",\"3_1403081609708965892\",\"3_1403081611927863298\",\"3_1403081614964445186\"]},\"author_id\":\"1234226465534881793\",\"entities\":{\"urls\":[{\"start\":284,\"end\":307,\"url\":\"https://t.co/OKNafqzNUm\",\"expanded_url\":\"https://twitter.com/FParianen/status/1403081616667385857/photo/1\",\"display_url\":\"pic.twitter.com/OKNafqzNUm\"},{\"start\":284,\"end\":307,\"url\":\"https://t.co/OKNafqzNUm\",\"expanded_url\":\"https://twitter.com/FParianen/status/1403081616667385857/photo/1\",\"display_url\":\"pic.twitter.com/OKNafqzNUm\"},{\"start\":284,\"end\":307,\"url\":\"https://t.co/OKNafqzNUm\",\"expanded_url\":\"https://twitter.com/FParianen/status/1403081616667385857/photo/1\",\"display_url\":\"pic.twitter.com/OKNafqzNUm\"},{\"start\":284,\"end\":307,\"url\":\"https://t.co/OKNafqzNUm\",\"expanded_url\":\"https://twitter.com/FParianen/status/1403081616667385857/photo/1\",\"display_url\":\"pic.twitter.com/OKNafqzNUm\"}],\"hashtags\":[{\"start\":271,\"end\":283,\"tag\":\"IchbinHanna\"}]},\"source\":\"Twitter for Android\",\"text\":\"Hanna ist Biologin. Sie erforscht Phytoplanktons Photosynthese. Wenn Leute die Lösung der Klimakrise auf Wissenschaft &amp; Innovation schieben, meinen sie auch Hanna. Hanna hat davon nix. Sie sucht wieder Fördermittel. Und eine Stelle. Und eine Wohnung. Hanna ist müde. #IchbinHanna https://t.co/OKNafqzNUm\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T20:08:20.000Z\"},{\"conversation_id\":\"1403339731874758658\",\"lang\":\"de\",\"id\":\"1403339731874758658\",\"public_metrics\":{\"retweet_count\":150,\"reply_count\":49,\"like_count\":709,\"quote_count\":6},\"author_id\":\"3631267755\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"}]},\"text\":\"#IchbinHanna und studiere im 31. Semester Ausdruckstanz und backe in meiner Freizeit gerne Algen-Brennessel-Brot. \\n\\nIch bin dafür, dass eine Welt ohne Arbeit viel friedlicher ist, denn es kommt genug Geld aus dem Bankautomaten.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T13:13:59.000Z\"},{\"conversation_id\":\"1403432003123433475\",\"lang\":\"de\",\"id\":\"1403432003123433475\",\"public_metrics\":{\"retweet_count\":73,\"reply_count\":8,\"like_count\":537,\"quote_count\":6},\"author_id\":\"891014603097952256\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":4,\"end\":16,\"tag\":\"IchbinHanna\"}]},\"text\":\"Bei #IchbinHanna ist das Problem, dass wir Professor*innen von einem Durchlauferhitzer profitieren, in dem sich befristet Beschäftigte verausgaben. Erst wenn wir das eingestehen und ablehnen, kann sich etwas ändern.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T19:20:38.000Z\"},{\"conversation_id\":\"1403322413321015299\",\"lang\":\"de\",\"id\":\"1403322413321015299\",\"public_metrics\":{\"retweet_count\":1,\"reply_count\":0,\"like_count\":5,\"quote_count\":0},\"author_id\":\"757192088207392768\",\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"}]},\"text\":\"#IchbinHanna und das Tagesthemen-Interview mit Lann Hornscheidt.\\n\\nMan sollte MINT-Fächer bevorzugt fördern.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T12:05:10.000Z\"},{\"entities\":{\"mentions\":[{\"start\":18,\"end\":26,\"username\":\"WissRat\"}],\"urls\":[{\"start\":280,\"end\":303,\"url\":\"https://t.co/nXx9PmYI3q\",\"expanded_url\":\"https://twitter.com/wissrat/status/1403332750749356039\",\"display_url\":\"twitter.com/wissrat/status…\"}],\"hashtags\":[{\"start\":267,\"end\":279,\"tag\":\"IchbinHanna\"}]},\"conversation_id\":\"1403571888970944513\",\"lang\":\"de\",\"id\":\"1403571888970944513\",\"public_metrics\":{\"retweet_count\":55,\"reply_count\":1,\"like_count\":206,\"quote_count\":0},\"author_id\":\"873988982115270657\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403332750749356039\"}],\"source\":\"Twitter for iPhone\",\"text\":\"2014 forderte der @WissRat inkl. Bund und Länder (!) eine Veränderung der universitären Stellenstruktur und dabei auch einen deutlichen Aufwuchs von Professuren und unbefristeten Stellen für wissenschaftliche  Mitarbeiter:innen mit angemessener Dotierung. Just do it #IchbinHanna https://t.co/nXx9PmYI3q\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T04:36:30.000Z\"},{\"entities\":{\"mentions\":[{\"start\":151,\"end\":161,\"username\":\"AmreiBahr\"},{\"start\":163,\"end\":175,\"username\":\"DrKEichhorn\"},{\"start\":181,\"end\":196,\"username\":\"SebastianKubon\"},{\"start\":202,\"end\":217,\"username\":\"zeitgeschichte\"},{\"start\":219,\"end\":230,\"username\":\"zzfpotsdam\"}],\"urls\":[{\"start\":231,\"end\":254,\"url\":\"https://t.co/uWoiPJ7iiK\",\"expanded_url\":\"https://zeitgeschichte-online.de/node/58477\",\"display_url\":\"zeitgeschichte-online.de/node/58477\"},{\"start\":255,\"end\":278,\"url\":\"https://t.co/MbBolU0Srz\",\"expanded_url\":\"https://twitter.com/RichterHedwig/status/1403718630659985410/photo/1\",\"display_url\":\"pic.twitter.com/MbBolU0Srz\"}],\"hashtags\":[{\"start\":137,\"end\":149,\"tag\":\"ichbinHanna\"}]},\"conversation_id\":\"1403718630659985410\",\"lang\":\"de\",\"id\":\"1403718630659985410\",\"public_metrics\":{\"retweet_count\":19,\"reply_count\":0,\"like_count\":71,\"quote_count\":1},\"attachments\":{\"media_keys\":[\"3_1403718613480116225\"]},\"author_id\":\"743152200281632768\",\"source\":\"Twitter Web App\",\"text\":\"\\\"Das Wissenschaftszeitvertragsgesetz und seine Effekte als Gegenstand zeithistorischer Wissenschaftsgeschichte\\\". Die Initiator:innen von #ichbinHanna, @AmreiBahr, @DrKEichhorn\\n und @SebastianKubon, auf @zeitgeschichte.\\n@zzfpotsdam\\nhttps://t.co/uWoiPJ7iiK https://t.co/MbBolU0Srz\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T14:19:36.000Z\"},{\"conversation_id\":\"1403798562157346819\",\"lang\":\"de\",\"id\":\"1403798562157346819\",\"public_metrics\":{\"retweet_count\":11,\"reply_count\":2,\"like_count\":35,\"quote_count\":2},\"author_id\":\"1344313798572830721\",\"entities\":{\"urls\":[{\"start\":216,\"end\":239,\"url\":\"https://t.co/NzRlSRoEUN\",\"expanded_url\":\"https://www.blaetter.de/ausgabe/2016/august/exzellente-entqualifizierung-das-neue-akademische-prekariat\",\"display_url\":\"blaetter.de/ausgabe/2016/a…\"}],\"hashtags\":[{\"start\":74,\"end\":86,\"tag\":\"IchbinHanna\"}]},\"source\":\"Twitter for iPad\",\"text\":\"Über die Strukturen des deutschen Wissenschaftssystems, die den Aufschrei #IchbinHanna verursacht haben:\\nExzellente Entqualifizierung: Das neue akademische Prekariat | Blätter für deutsche und internationale Politik https://t.co/NzRlSRoEUN\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T19:37:13.000Z\"},{\"conversation_id\":\"1403605974200590338\",\"lang\":\"de\",\"id\":\"1403605974200590338\",\"public_metrics\":{\"retweet_count\":62,\"reply_count\":23,\"like_count\":558,\"quote_count\":1},\"attachments\":{\"media_keys\":[\"3_1403605541990060034\"]},\"author_id\":\"99718385\",\"entities\":{\"urls\":[{\"start\":260,\"end\":283,\"url\":\"https://t.co/yBVlOYZSwJ\",\"expanded_url\":\"https://twitter.com/_donalphonso/status/1403605974200590338/photo/1\",\"display_url\":\"pic.twitter.com/yBVlOYZSwJ\"}],\"hashtags\":[{\"start\":38,\"end\":50,\"tag\":\"IchbinHanna\"}]},\"source\":\"Twitter Web App\",\"text\":\"Unter den Akademikern, die sich unter #IchbinHanna über den sozialen Abstieg beschwerten, waren sehr viele Frauen, die gegendert haben oder sowas in der Art studierten. Kunstgeschichtlerinnen heiraten Ärzte oder haben reiche Eltern, die haben das nicht nötig. https://t.co/yBVlOYZSwJ\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T06:51:56.000Z\"},{\"conversation_id\":\"1403639076255846402\",\"lang\":\"de\",\"id\":\"1403639076255846402\",\"public_metrics\":{\"retweet_count\":37,\"reply_count\":3,\"like_count\":214,\"quote_count\":1},\"author_id\":\"1260870565541396480\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":181,\"end\":192,\"tag\":\"WissZeitVG\"},{\"start\":270,\"end\":282,\"tag\":\"IchBinHanna\"}]},\"text\":\"Hanna hat in der Pandemie aus dem Nichts digitale Lehre auf die Beine gestellt, damit Studieren weiter möglich ist. Mehrarbeit zulasten ihrer eigenen Qualifikation &amp; Projekte.  #WissZeitVG-Coronaverlängerung allein hilft ihr nicht, sie braucht Vertragsverlängerung. #IchBinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T09:03:28.000Z\"},{\"conversation_id\":\"1403701429659897862\",\"lang\":\"de\",\"id\":\"1403701429659897862\",\"public_metrics\":{\"retweet_count\":15,\"reply_count\":4,\"like_count\":132,\"quote_count\":2},\"author_id\":\"1060649378816368642\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"}]},\"text\":\"#IchbinHanna als nicht Akademikerkind bekommt man an der Uni dann auch gerne mal den gutgemeinten Rat, sich in Diskussionen zurückzuhalten und seine Herkunft nicht offen zu legen. Sorry, aber da halte ich es lieber mit Bourdieu und halte mich nicht daran.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T13:11:14.000Z\"},{\"in_reply_to_user_id\":\"970421608362934272\",\"conversation_id\":\"1403040872145489922\",\"lang\":\"de\",\"id\":\"1403099315040624643\",\"public_metrics\":{\"retweet_count\":79,\"reply_count\":36,\"like_count\":308,\"quote_count\":6},\"attachments\":{\"media_keys\":[\"3_1403098785144840195\",\"3_1403098785174142980\",\"3_1403098785161560065\",\"3_1403098785195216897\"]},\"author_id\":\"970421608362934272\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403040872145489922\"}],\"entities\":{\"urls\":[{\"start\":275,\"end\":298,\"url\":\"https://t.co/BtiHvqQJxH\",\"expanded_url\":\"https://twitter.com/Ruebenhorst/status/1403099315040624643/photo/1\",\"display_url\":\"pic.twitter.com/BtiHvqQJxH\"},{\"start\":275,\"end\":298,\"url\":\"https://t.co/BtiHvqQJxH\",\"expanded_url\":\"https://twitter.com/Ruebenhorst/status/1403099315040624643/photo/1\",\"display_url\":\"pic.twitter.com/BtiHvqQJxH\"},{\"start\":275,\"end\":298,\"url\":\"https://t.co/BtiHvqQJxH\",\"expanded_url\":\"https://twitter.com/Ruebenhorst/status/1403099315040624643/photo/1\",\"display_url\":\"pic.twitter.com/BtiHvqQJxH\"},{\"start\":275,\"end\":298,\"url\":\"https://t.co/BtiHvqQJxH\",\"expanded_url\":\"https://twitter.com/Ruebenhorst/status/1403099315040624643/photo/1\",\"display_url\":\"pic.twitter.com/BtiHvqQJxH\"}],\"hashtags\":[{\"start\":121,\"end\":133,\"tag\":\"IchBinHanna\"}]},\"source\":\"Twitter Web App\",\"text\":\"Sorry aber ich lache noch immer über diese personifizierten Fehlallokationen volkswirtschaftlicher Ressourcen, die unter #IchBinHanna ihr großes demonstratives Schaulaufen veranstalten. Wie sehr kann man eigentlich zu seiner eigenen, grob überzeichneten Karikatur erstarren? https://t.co/BtiHvqQJxH\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T21:18:39.000Z\"},{\"conversation_id\":\"1403810094815580161\",\"lang\":\"de\",\"id\":\"1403810094815580161\",\"public_metrics\":{\"retweet_count\":5,\"reply_count\":1,\"like_count\":66,\"quote_count\":0},\"author_id\":\"1062831254\",\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":26,\"end\":38,\"tag\":\"IchBinHanna\"}]},\"text\":\"Ich habe das Gefühl, dass #IchBinHanna auch bei Betroffenen, die bisher eher zurückhaltend waren, das Fass zum Überlaufen bringt.\\n Gut so! Weiter so! Es geht nur gemeinsam!\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T20:23:02.000Z\"},{\"conversation_id\":\"1403836716549656579\",\"lang\":\"de\",\"id\":\"1403836716549656579\",\"public_metrics\":{\"retweet_count\":6,\"reply_count\":2,\"like_count\":29,\"quote_count\":1},\"author_id\":\"198464953\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":90,\"end\":101,\"tag\":\"WissZeitVG\"},{\"start\":265,\"end\":277,\"tag\":\"IchbinHanna\"}]},\"text\":\"Reden wir mal über die, die noch nicht den Schritt in die Wissenschaft gemacht haben: Das #WissZeitVG setzt eine Maximalstundenzahl fest, die Studis mit Bachelorabschluss an der Uni arbeiten dürfen. Ansonsten wird die Zeit auf die Qualifikationsphase angerechnet. \\n#IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T22:08:49.000Z\"},{\"conversation_id\":\"1403504215784308736\",\"lang\":\"de\",\"id\":\"1403504215784308736\",\"public_metrics\":{\"retweet_count\":8,\"reply_count\":3,\"like_count\":47,\"quote_count\":3},\"author_id\":\"1368312532067356676\",\"entities\":{\"urls\":[{\"start\":149,\"end\":172,\"url\":\"https://t.co/oMqryOdwZM\",\"expanded_url\":\"https://www.blaetter.de/ausgabe/2016/august/exzellente-entqualifizierung-das-neue-akademische-prekariat\",\"display_url\":\"blaetter.de/ausgabe/2016/a…\",\"unwound_url\":\"https://www.blaetter.de/ausgabe/2016/august/exzellente-entqualifizierung-das-neue-akademische-prekariat\"}],\"hashtags\":[{\"start\":119,\"end\":147,\"tag\":\"ExzellenteEntqualifizierung\"},{\"start\":256,\"end\":268,\"tag\":\"IchbinHanna\"}]},\"source\":\"Twitter Web App\",\"text\":\"Vor fünf Jahren schrieb ich erschöpft und wütend einen Artikel in den Blättern für deutsche und internationale Politik #ExzellenteEntqualifizierung (https://t.co/oMqryOdwZM) - und habe seitdem gelernt: nur wenn wir uns organisieren, haben wir eine Chance. #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T00:07:35.000Z\"},{\"entities\":{\"mentions\":[{\"start\":142,\"end\":151,\"username\":\"gew_bund\"},{\"start\":152,\"end\":163,\"username\":\"AKellerGEW\"}],\"urls\":[{\"start\":279,\"end\":302,\"url\":\"https://t.co/1Pc0XQPbTt\",\"expanded_url\":\"https://twitter.com/brittaluciaida1/status/1403768015099924491\",\"display_url\":\"twitter.com/brittaluciaida…\"}],\"hashtags\":[{\"start\":62,\"end\":74,\"tag\":\"IchbinHanna\"},{\"start\":106,\"end\":140,\"tag\":\"hannaistjetztgewerkschaftsmitlied\"},{\"start\":208,\"end\":220,\"tag\":\"IchbinHanna\"},{\"start\":226,\"end\":242,\"tag\":\"HannamachtPause\"}]},\"conversation_id\":\"1403776012299689993\",\"lang\":\"de\",\"id\":\"1403776012299689993\",\"public_metrics\":{\"retweet_count\":5,\"reply_count\":1,\"like_count\":24,\"quote_count\":0},\"author_id\":\"2990340688\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403768015099924491\"}],\"source\":\"Twitter for iPhone\",\"text\":\"„Man duckt sich lieber weg.“ Wir müssen hinsehen und handeln. #IchbinHanna hat sich Unterstützung geholt  #hannaistjetztgewerkschaftsmitlied. @gew_bund @AKellerGEW \\n\\nWas würde eigentlich passieren, wenn alle #IchbinHanna eine #HannamachtPause einlegen? Steht das Rad dann still? https://t.co/1Pc0XQPbTt\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T18:07:36.000Z\"},{\"conversation_id\":\"1403799802220064771\",\"lang\":\"de\",\"id\":\"1403799802220064771\",\"public_metrics\":{\"retweet_count\":1,\"reply_count\":0,\"like_count\":23,\"quote_count\":0},\"author_id\":\"2980937392\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":268,\"end\":280,\"tag\":\"IchbinHanna\"}]},\"text\":\"Ich war Hanna. 4-5 J. befristet beschäftigt, jährliche Verlängerungen mit 25-50%, parallel zu einem Stipendium. Seit 2019 unbefristet (für die Lehre), seit 2020 verbeamtet als StR i.H. Seitdem: Größere Offenheit für neue Themen, mehr Zeit, Ausdauer, Mut, Kreativität. #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T19:42:08.000Z\"},{\"in_reply_to_user_id\":\"1260870565541396480\",\"conversation_id\":\"1403681085930807296\",\"lang\":\"de\",\"id\":\"1403682100855951362\",\"public_metrics\":{\"retweet_count\":12,\"reply_count\":1,\"like_count\":101,\"quote_count\":4},\"author_id\":\"1260870565541396480\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403681085930807296\"}],\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":268,\"end\":280,\"tag\":\"IchBinHanna\"}]},\"text\":\"Und wer glaubt, dass Hanna diese Überstunden vergütet werden oder dass sie sie abfeiern kann, irrt. Unbezahlte Mehrarbeit wird in der Wissenschaft als selbstverständlich vorausgesetzt. Auch ein Exklusionsmechanismus, der die ausschließt, die sie nicht leisten können. #IchBinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T11:54:26.000Z\"},{\"conversation_id\":\"1403716492928204801\",\"lang\":\"de\",\"id\":\"1403716492928204801\",\"public_metrics\":{\"retweet_count\":1,\"reply_count\":0,\"like_count\":14,\"quote_count\":0},\"author_id\":\"1401370907256496132\",\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":234,\"end\":246,\"tag\":\"IchbinHanna\"}]},\"text\":\"Präkere Arbeitsverhältnisse begünstigen Machtmissbrauch. Ich war Post-Doc, hatte gut publiziert, Drittmittel eingeworben und -  korruptes Verhalten kritisiert. Jetzt bin 39 J. und werde totgeschwiegen, weil ich mich schützen wollte. \\n#IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T14:11:06.000Z\"},{\"conversation_id\":\"1403269666236211201\",\"lang\":\"de\",\"id\":\"1403269666236211201\",\"public_metrics\":{\"retweet_count\":42,\"reply_count\":2,\"like_count\":129,\"quote_count\":5},\"author_id\":\"762628724235829248\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"},{\"start\":36,\"end\":47,\"tag\":\"WissZeitVG\"}]},\"text\":\"#IchbinHanna Meine Punkte dazu: Das #WissZeitVG beruht auf der Vorstellung, möglichst vielen die Chance zu geben, sich für eine Professur (nicht: eine Stelle als Wissenschaftler:in) zu qualifizieren, damit dann die besten es werden. Es ist also von vornherein vorgesehen, dass 1/\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T08:35:34.000Z\"},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":15,\"username\":\"kinderkongress\"}],\"urls\":[{\"start\":231,\"end\":254,\"url\":\"https://t.co/c7i01M6fVL\",\"expanded_url\":\"https://www.youtube.com/watch?v=-5f0t6krpXQ\",\"display_url\":\"youtube.com/watch?v=-5f0t6…\"}],\"hashtags\":[{\"start\":84,\"end\":88,\"tag\":\"FFF\"},{\"start\":100,\"end\":107,\"tag\":\"Illner\"},{\"start\":111,\"end\":120,\"tag\":\"Baerbock\"},{\"start\":127,\"end\":139,\"tag\":\"Wagenknecht\"},{\"start\":154,\"end\":172,\"tag\":\"Kanzlerkandidatin\"},{\"start\":257,\"end\":267,\"tag\":\"Promotion\"},{\"start\":268,\"end\":280,\"tag\":\"IchbinHanna\"},{\"start\":281,\"end\":296,\"tag\":\"FreeGeorgThiel\"}]},\"in_reply_to_user_id\":\"1390655542733987843\",\"conversation_id\":\"1400206363595317248\",\"lang\":\"de\",\"id\":\"1403102519941898247\",\"public_metrics\":{\"retweet_count\":6,\"reply_count\":0,\"like_count\":15,\"quote_count\":0},\"author_id\":\"1233917125636632579\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1400206363595317248\"}],\"context_annotations\":[{\"domain\":{\"id\":\"10\",\"name\":\"Person\",\"description\":\"Named people in the world like Nelson Mandela\"},\"entity\":{\"id\":\"827111688893652993\",\"name\":\"Sahra Wagenknecht\",\"description\":\"Sahra Wagenknecht\"}},{\"domain\":{\"id\":\"35\",\"name\":\"Politician\",\"description\":\"Politicians in the world, like Joe Biden\"},\"entity\":{\"id\":\"827111688893652993\",\"name\":\"Sahra Wagenknecht\",\"description\":\"Sahra Wagenknecht\"}}],\"source\":\"Twitter Web App\",\"text\":\"@kinderkongress Leider! Wir ahnen Ungutes. Das ganze GEZ-Getue um diese Mädchen bei #FFF (\\\"künftige #Illner|s, #Baerbock|s und #Wagenknecht|s, trainierte #Kanzlerkandidatin|nen\\\") erinnert auf fatale Art und Weise an eine Sekte (s. https://t.co/c7i01M6fVL). #Promotion #IchbinHanna #FreeGeorgThiel\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T21:31:23.000Z\"},{\"conversation_id\":\"1403818870385827845\",\"lang\":\"de\",\"id\":\"1403818870385827845\",\"public_metrics\":{\"retweet_count\":1,\"reply_count\":1,\"like_count\":12,\"quote_count\":0},\"author_id\":\"1356673865557159936\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":24,\"end\":36,\"tag\":\"IchbinHanna\"}]},\"text\":\"Vgl. Profilbeschreibung #IchbinHanna; seit 15 Jahren. \\nNach Jahren im Wissenschaftsbetrieb in Projektarbeit mit Befristungen von z. T. 3 Monaten, verdiene ich realiter ähnlich viel wie mit19 Jahren beim Bund\\nNach Dutzenden Fachpublikationen gilt man als \\\"Nachwuchswissenschaftler\\\"\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T20:57:55.000Z\"},{\"conversation_id\":\"1403689326098124801\",\"lang\":\"de\",\"id\":\"1403689326098124801\",\"public_metrics\":{\"retweet_count\":24,\"reply_count\":1,\"like_count\":141,\"quote_count\":1},\"author_id\":\"1300742151316398081\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":178,\"end\":190,\"tag\":\"IchbinHanna\"},{\"start\":191,\"end\":219,\"tag\":\"acertaindegreeofflexibility\"}]},\"text\":\"Hanna hat übrigens auch in der Pandemie voll (online) gelehrt, weil die Uni das so wollte. Ohne Anspruch auf Kinderbetreuung. Ihre Uni hat ihr gesagt: \\\"Finde kreative Lösungen!\\\" #IchbinHanna #acertaindegreeofflexibility\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T12:23:09.000Z\"},{\"entities\":{\"mentions\":[{\"start\":271,\"end\":280,\"username\":\"gew_bund\"}],\"hashtags\":[{\"start\":13,\"end\":25,\"tag\":\"IchbinHanna\"}]},\"conversation_id\":\"1403628602655182848\",\"lang\":\"de\",\"id\":\"1403628602655182848\",\"public_metrics\":{\"retweet_count\":6,\"reply_count\":1,\"like_count\":22,\"quote_count\":2},\"author_id\":\"759523247734022144\",\"source\":\"Twitter for iPhone\",\"text\":\"Nach 2 Tagen #IchbinHanna taucht hier und da die Frage auf: Was nun? \\n\\nWir sind alle unzufrieden? Wir werden von unseren Arbeitgebern scheiße behandelt? Das ganze gesetzliche System ist einem guten Leben gegenüber feindlich?\\n\\nAb in die Gewerkschaft! Streikfähig werden!\\n\\n@gew_bund\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T08:21:51.000Z\"},{\"conversation_id\":\"1403627627483602945\",\"lang\":\"de\",\"id\":\"1403627627483602945\",\"public_metrics\":{\"retweet_count\":9,\"reply_count\":1,\"like_count\":93,\"quote_count\":2},\"author_id\":\"970565442090799109\",\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"}]},\"text\":\"#IchbinHanna \\\"Sonderschul-\\\" und \\\"Hauptschulempfehlung\\\", Realschule und 3,0 Abi. Erster Studienplatz nach 2 Jahren Wartezeit. 2 B.A. und 2 M.A. (Soziale Arbeit, Geschichte etc). Neben Doppelstudium Pflege von Oma und Job. Promotion mit  Stipendium zur NS-Zeit. 3 (!) Mon. (1/2)\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T08:17:59.000Z\"},{\"entities\":{\"mentions\":[{\"start\":70,\"end\":80,\"username\":\"TVStud_HH\"},{\"start\":82,\"end\":92,\"username\":\"TVStudGoe\"},{\"start\":94,\"end\":103,\"username\":\"TvBremen\"},{\"start\":105,\"end\":119,\"username\":\"TVStud_Berlin\"},{\"start\":121,\"end\":129,\"username\":\"TvstudM\"},{\"start\":131,\"end\":144,\"username\":\"lernmeuterei\"},{\"start\":146,\"end\":154,\"username\":\"BDWi_ev\"},{\"start\":156,\"end\":163,\"username\":\"fzs_ev\"}],\"hashtags\":[{\"start\":57,\"end\":69,\"tag\":\"IchbinHanna\"}]},\"in_reply_to_user_id\":\"730098730943324162\",\"conversation_id\":\"1403802726128041986\",\"lang\":\"de\",\"id\":\"1403804402885042176\",\"public_metrics\":{\"retweet_count\":8,\"reply_count\":1,\"like_count\":34,\"quote_count\":1},\"author_id\":\"730098730943324162\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403802726128041986\"}],\"source\":\"Twitter Web App\",\"text\":\"Und mit Ausweitung der Gruppen arbeiten am Systemwandel: #IchbinHanna\\n@TVStud_HH \\n@TVStudGoe \\n@TvBremen \\n@TVStud_Berlin \\n@TvstudM \\n@lernmeuterei \\n@BDWi_ev \\n@fzs_ev\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T20:00:25.000Z\"},{\"conversation_id\":\"1403786358116732932\",\"lang\":\"de\",\"id\":\"1403786358116732932\",\"public_metrics\":{\"retweet_count\":3,\"reply_count\":5,\"like_count\":42,\"quote_count\":0},\"author_id\":\"1278718023726239745\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403283658694443010\"}],\"entities\":{\"urls\":[{\"start\":261,\"end\":284,\"url\":\"https://t.co/0n5qjuU1E4\",\"expanded_url\":\"https://twitter.com/JGovrin/status/1403283658694443010\",\"display_url\":\"twitter.com/JGovrin/status…\"}],\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"},{\"start\":129,\"end\":134,\"tag\":\"BMBF\"},{\"start\":223,\"end\":246,\"tag\":\"acertaindegreeofstreik\"}]},\"source\":\"Twitter Web App\",\"text\":\"#IchbinHanna bildet keine reine Ansammlung von Einzelschicksalen, sondern zeugt von der systematischen  Prekarisierung durch das #BMBF, es gilt daher, sich weiter zu solidarisieren, gewerkschaftlich zu organisieren und mit #acertaindegreeofstreik zu reagieren. https://t.co/0n5qjuU1E4\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T18:48:43.000Z\"},{\"conversation_id\":\"1403806806401507330\",\"lang\":\"de\",\"id\":\"1403806806401507330\",\"public_metrics\":{\"retweet_count\":4,\"reply_count\":1,\"like_count\":34,\"quote_count\":0},\"author_id\":\"730098730943324162\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1402595115043115008\"}],\"entities\":{\"urls\":[{\"start\":192,\"end\":215,\"url\":\"https://t.co/b8rjTXqAMs\",\"expanded_url\":\"https://twitter.com/DrKEichhorn/status/1402595115043115008\",\"display_url\":\"twitter.com/DrKEichhorn/st…\"}],\"hashtags\":[{\"start\":179,\"end\":191,\"tag\":\"IchbinHanna\"}]},\"source\":\"Twitter Web App\",\"text\":\"Falls ihr euch fragt, wie viele jetzt dieses Video gesehen haben: Aus dem Tweet sind inzwischen knapp 11.000 Linkklicks gefolgt. Dürften noch einige mehr sein über andere Kanäle. #IchbinHanna https://t.co/b8rjTXqAMs\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T20:09:58.000Z\"},{\"conversation_id\":\"1403239941908336643\",\"lang\":\"de\",\"id\":\"1403239941908336643\",\"public_metrics\":{\"retweet_count\":8,\"reply_count\":0,\"like_count\":32,\"quote_count\":0},\"author_id\":\"1260870565541396480\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1384427327786995712\"}],\"entities\":{\"urls\":[{\"start\":138,\"end\":161,\"url\":\"https://t.co/iQmjEOWvGN\",\"expanded_url\":\"https://twitter.com/amreibahr/status/1384427327786995712\",\"display_url\":\"twitter.com/amreibahr/stat…\"}],\"hashtags\":[{\"start\":125,\"end\":137,\"tag\":\"IchBinHanna\"}]},\"source\":\"Twitter for iPhone\",\"text\":\"Wollt Ihr wissen, wie es für Hanna weitergeht, wenn sie nach der Promotion in der Wissenschaft bleibt? Dann schaut mal hier. #IchBinHanna https://t.co/iQmjEOWvGN\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T06:37:27.000Z\"},{\"in_reply_to_user_id\":\"258353673\",\"conversation_id\":\"1403825792669335554\",\"lang\":\"de\",\"id\":\"1403825806871306244\",\"public_metrics\":{\"retweet_count\":11,\"reply_count\":1,\"like_count\":315,\"quote_count\":2},\"author_id\":\"258353673\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403825804828712960\"}],\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":233,\"end\":245,\"tag\":\"IchbinHanna\"}]},\"text\":\"Jetzt gab es gar keine dauerhaften Perspektiven mehr unterhalb der Professur. \\n\\nDas Pendel war krass in die die andere Richtung geschwungen. Sie leistete der Prekarisierung und fundamentalen Unsicherheit Vorschub, die aktuell in der #IchbinHanna Kampagne ein Gesicht bekommt. /9\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T21:25:28.000Z\"},{\"conversation_id\":\"1403081714520428546\",\"lang\":\"de\",\"id\":\"1403081714520428546\",\"public_metrics\":{\"retweet_count\":493,\"reply_count\":42,\"like_count\":3462,\"quote_count\":18},\"author_id\":\"2316172198\",\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":6,\"end\":18,\"tag\":\"IchbinHanna\"}]},\"text\":\"Unter #IchbinHanna teilen gerade viele Wissenschaftler:innen, was die Befristungen in der Wissenschaft mit ihnen &amp; ihrem Leben machen. Es ist Ziet, endlich die Arbeitsbedingungen für Wissenschaftler:innen zu verbessern. Wie wichtig ihre Arbeit ist, zeigt nicht nur die Pandemie.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T20:08:43.000Z\"},{\"conversation_id\":\"1403743159163699208\",\"lang\":\"de\",\"id\":\"1403743159163699208\",\"public_metrics\":{\"retweet_count\":18,\"reply_count\":3,\"like_count\":120,\"quote_count\":1},\"author_id\":\"1200343938361634817\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":265,\"end\":277,\"tag\":\"IchbinHanna\"}]},\"text\":\"ein besonders absurder Aspekt des WissZeitVG sollte nicht unerwähnt bleiben: 2 Jahre auf einer 50%-Stelle zählen genauso viel wie 2 Jahre auf einer 100%-Stelle \\nUnd wem das nicht absurd genug ist: Promotionsphasen OHNE Stelle zählen wie Promotionsphasen mit Stelle\\n#IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T15:57:04.000Z\"},{\"conversation_id\":\"1402987144742719494\",\"lang\":\"de\",\"id\":\"1402987144742719494\",\"public_metrics\":{\"retweet_count\":11,\"reply_count\":2,\"like_count\":148,\"quote_count\":1},\"author_id\":\"629316502\",\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":245,\"end\":257,\"tag\":\"IchbinHanna\"}]},\"text\":\"Ich bin Sandra, Psychologin und Psychotherapeutin. Ich habe über 12 Jahre geforscht und hatte immer befristete Arbeitsverträge zwischen 6 Monaten und 2 Jahren Dauer. Ich bin aufgrund der prekären Lage aus dem Wissenschaftsbetrieb ausgestiegen. \\n#IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T13:52:56.000Z\"},{\"conversation_id\":\"1403818610188066820\",\"lang\":\"de\",\"id\":\"1403818610188066820\",\"public_metrics\":{\"retweet_count\":5,\"reply_count\":2,\"like_count\":18,\"quote_count\":0},\"author_id\":\"2289479446\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403804402885042176\"}],\"entities\":{\"urls\":[{\"start\":183,\"end\":206,\"url\":\"https://t.co/hTLhmq9btO\",\"expanded_url\":\"https://www.bdwi.de/bdwi/mitglied/index.html\",\"display_url\":\"bdwi.de/bdwi/mitglied/…\"},{\"start\":265,\"end\":288,\"url\":\"https://t.co/GpIHfqGEbd\",\"expanded_url\":\"https://twitter.com/DrKEichhorn/status/1403804402885042176\",\"display_url\":\"twitter.com/DrKEichhorn/st…\"}],\"hashtags\":[{\"start\":0,\"end\":6,\"tag\":\"Danke\"},{\"start\":93,\"end\":98,\"tag\":\"BdWi\"},{\"start\":208,\"end\":220,\"tag\":\"IchbinHanna\"},{\"start\":221,\"end\":232,\"tag\":\"solidarity\"},{\"start\":233,\"end\":264,\"tag\":\"Solidaritätmusspraktischwerden\"}]},\"source\":\"Twitter for Android\",\"text\":\"#Danke für den Hinweis auf all diese Verbände! Ich freue mich über alle neuen Gesichter beim #BdWi - dem Bund demokratischer Wissenschaftler*innen. \\uD83E\\uDD1D\\n\\nHier könnt ihr Mitglied werden:\\nhttps://t.co/hTLhmq9btO\\n\\n#IchbinHanna #solidarity #Solidaritätmusspraktischwerden https://t.co/GpIHfqGEbd\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T20:56:53.000Z\"},{\"conversation_id\":\"1403681085930807296\",\"lang\":\"de\",\"id\":\"1403681085930807296\",\"public_metrics\":{\"retweet_count\":25,\"reply_count\":9,\"like_count\":174,\"quote_count\":0},\"author_id\":\"1260870565541396480\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":5,\"end\":11,\"tag\":\"BuWiN\"},{\"start\":267,\"end\":279,\"tag\":\"IchBinHanna\"}]},\"text\":\"Laut #BuWiN macht Hanna in der Promotion im Schnitt 13 Überstunden pro Woche, in der Postdoc-Phase 10. Würde sie nur soviel arbeiten wie im Vertrag steht, wären Forschung/Lehre so nicht mehr möglich. Birgt für sie aber das Risiko, dass Vertrag nicht verlängert wird. #IchBinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T11:50:24.000Z\"},{\"conversation_id\":\"1403034619209994240\",\"lang\":\"de\",\"id\":\"1403034619209994240\",\"public_metrics\":{\"retweet_count\":40,\"reply_count\":4,\"like_count\":502,\"quote_count\":4},\"author_id\":\"1277153050420031488\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":264,\"end\":276,\"tag\":\"IchbinHanna\"}]},\"text\":\"Dass ich eine Professur habe, hatte viel mit Kontingenz, Tagesform, ja auch mit Glück zu tun. Mich erstaunt, wie schnell in Teilen des Betriebs Verdrängungsmechanismen und das meritokratische Umschreiben der eigenen Seiltanzbiografie einsetzen. Das muss aufhören. #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T17:01:34.000Z\"},{\"in_reply_to_user_id\":\"1234226465534881793\",\"conversation_id\":\"1403081616667385857\",\"lang\":\"de\",\"id\":\"1403086636217417735\",\"public_metrics\":{\"retweet_count\":6,\"reply_count\":1,\"like_count\":119,\"quote_count\":1},\"author_id\":\"1234226465534881793\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403081616667385857\"}],\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":21,\"end\":33,\"tag\":\"IchbinHanna\"}]},\"text\":\"So viele Leute unter #IchbinHanna denken, das Problem hätten nur Geisteswissenschaften. Dabei waren meine Arbeitsbedingungen beim Eine Welt Netz NRW oder als freie Autorin immer stabiler als die als Neurowissenschaftlerin.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T20:28:16.000Z\"},{\"in_reply_to_user_id\":\"258353673\",\"conversation_id\":\"1403825792669335554\",\"lang\":\"de\",\"id\":\"1403825804828712960\",\"public_metrics\":{\"retweet_count\":10,\"reply_count\":2,\"like_count\":284,\"quote_count\":0},\"author_id\":\"258353673\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403825802878275585\"}],\"source\":\"Twitter Web App\",\"text\":\"Tja, und das war dann das Ende der Dauerstellen im wiss. Mittelbau.\\n\\nUnd was mal irgendwann mit einem durchaus sinnvollen Gedanken begann - weniger Verkrustung, sondern Wechsel im akad. Betrieb - pervertierte sich im Laufe der Jahre dann total. /8\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T21:25:28.000Z\"},{\"conversation_id\":\"1403298601296666629\",\"lang\":\"de\",\"id\":\"1403298601296666629\",\"public_metrics\":{\"retweet_count\":2,\"reply_count\":1,\"like_count\":8,\"quote_count\":0},\"author_id\":\"802963684196749312\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403001909917614084\"}],\"entities\":{\"urls\":[{\"start\":234,\"end\":257,\"url\":\"https://t.co/FTBICa9f2R\",\"expanded_url\":\"https://twitter.com/mahaelhissy/status/1403001909917614084\",\"display_url\":\"twitter.com/mahaelhissy/st…\"}],\"hashtags\":[{\"start\":221,\"end\":233,\"tag\":\"IchbinHanna\"}]},\"source\":\"Twitter for Android\",\"text\":\"BIPOC/migrantische Wissenschaftler:innen verdeutlichen strukturelle Mehrfach-Prekarisierung und werden dafür verhöhnt/beleidgt -&gt; intersektionale Perspektiven müssen in Gerechtigkeits-Diskursen geltend gemacht werden. #IchbinHanna https://t.co/FTBICa9f2R\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T10:30:33.000Z\"},{\"conversation_id\":\"1403246757878849538\",\"lang\":\"de\",\"id\":\"1403246757878849538\",\"public_metrics\":{\"retweet_count\":111,\"reply_count\":14,\"like_count\":440,\"quote_count\":23},\"author_id\":\"971111853526044672\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":51,\"end\":63,\"tag\":\"IchbinHanna\"}]},\"text\":\"Viele Geisteswissenschaftler*innen, die sich unter #IchbinHanna geäußert haben, mussten sich anhören, sie hätten sich ja selbst für eine brotlose Kunst entschieden. Was antwortet man darauf? Ein Thread 1/x\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T07:04:32.000Z\"},{\"entities\":{\"mentions\":[{\"start\":11,\"end\":27,\"username\":\"brittaluciaida1\"}],\"urls\":[{\"start\":185,\"end\":208,\"url\":\"https://t.co/otJpHsh9oF\",\"expanded_url\":\"https://twitter.com/brittaluciaida1/status/1403504215784308736\",\"display_url\":\"twitter.com/brittaluciaida…\"}],\"hashtags\":[{\"start\":171,\"end\":183,\"tag\":\"IchbinHanna\"}]},\"conversation_id\":\"1403792617201188871\",\"lang\":\"de\",\"id\":\"1403792617201188871\",\"public_metrics\":{\"retweet_count\":1,\"reply_count\":2,\"like_count\":12,\"quote_count\":0},\"author_id\":\"730098730943324162\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403504215784308736\"}],\"source\":\"Twitter Web App\",\"text\":\"Dafür dass @brittaluciaida1 laut Profil gar nicht twittern will, ist sie jetzt doch recht aktiv geworden. Gut so! Also ruhig folgen - schaden kann's nicht, im Gegenteil! \\uD83D\\uDE00#IchbinHanna\\n\\nhttps://t.co/otJpHsh9oF\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T19:13:35.000Z\"},{\"entities\":{\"mentions\":[{\"start\":4,\"end\":14,\"username\":\"BMBF_Bund\"},{\"start\":228,\"end\":238,\"username\":\"AmreiBahr\"},{\"start\":239,\"end\":251,\"username\":\"DrKEichhorn\"}],\"urls\":[{\"start\":281,\"end\":304,\"url\":\"https://t.co/um7JiRC3kW\",\"expanded_url\":\"https://twitter.com/DrKEichhorn/status/1402595115043115008\",\"display_url\":\"twitter.com/DrKEichhorn/st…\"}],\"hashtags\":[{\"start\":195,\"end\":207,\"tag\":\"IchbinHanna\"},{\"start\":212,\"end\":227,\"tag\":\"95vsWissZeitVG\"},{\"start\":252,\"end\":280,\"tag\":\"acertaindegreeofflexibility\"}]},\"conversation_id\":\"1402886172158873600\",\"lang\":\"de\",\"id\":\"1402886172158873600\",\"public_metrics\":{\"retweet_count\":243,\"reply_count\":14,\"like_count\":1057,\"quote_count\":43},\"author_id\":\"1244061463\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1402595115043115008\"}],\"source\":\"Twitter for iPhone\",\"text\":\"Das @BMBF_Bund verschleißt befristete Wissenschaftler_innen und verhöhnt sie auch noch. Zur Erinnerung, dass das WissZeitVG sich gegen Menschen richtet, gebe ich dem wiss. Prekariat ein Gesicht: #IchbinHanna.    #95vsWissZeitVG @AmreiBahr @DrKEichhorn #acertaindegreeofflexibility https://t.co/um7JiRC3kW\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T07:11:42.000Z\"},{\"conversation_id\":\"1403800980542607360\",\"lang\":\"de\",\"id\":\"1403800980542607360\",\"public_metrics\":{\"retweet_count\":8,\"reply_count\":3,\"like_count\":56,\"quote_count\":0},\"author_id\":\"244929755\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":11,\"end\":23,\"tag\":\"IchbinHanna\"}]},\"geo\":{\"place_id\":\"1876307c1fe06ccd\"},\"text\":\"Was an der #IchbinHanna Diskussion besonders interessant ist: In keiner anderen Branche heißt es, dass eine Generation Stellen „verstopft“ und deshalb nach 12 Jahren ein Glücksspiel mit Lebensbruch Risiko stattfinden muss. Auch in der internationalen Wissenschaft ist das nicht so\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T19:46:49.000Z\"},{\"conversation_id\":\"1403622934955147264\",\"lang\":\"de\",\"id\":\"1403622934955147264\",\"public_metrics\":{\"retweet_count\":2,\"reply_count\":1,\"like_count\":10,\"quote_count\":1},\"author_id\":\"1239483873442103299\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"}]},\"text\":\"#IchbinHanna Die Problemlage stellt sich in Österreich 1 zu 1 gleich dar. Mit dem neuen § 109 UG verschlimmert sie sich noch. Die Höchstbefristungsdauer von 8 Jahren drängt noch mehr WissenschaftlerInnen als bisher in prekäre Arbeitsverhältnisse u. Umgehungskonstruktionen.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T07:59:20.000Z\"},{\"conversation_id\":\"1403814491071172611\",\"lang\":\"de\",\"id\":\"1403814491071172611\",\"public_metrics\":{\"retweet_count\":1,\"reply_count\":1,\"like_count\":2,\"quote_count\":0},\"author_id\":\"1211270483678646273\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"},{\"start\":227,\"end\":242,\"tag\":\"FreeGeorgThiel\"}]},\"text\":\"#IchbinHanna Habe einen 7 Tage 3 Schichten Job . Zahle Zuviel steuern um Sozialschmarotzer  zu ermöglichen 30 Semester Gendern oder Tanz deinen Namen zu studieren. Um danach zu jammern das sie damit kein Geld verdienen können. #FreeGeorgThiel\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T20:40:30.000Z\"},{\"conversation_id\":\"1403803240110637064\",\"lang\":\"de\",\"id\":\"1403803240110637064\",\"public_metrics\":{\"retweet_count\":5,\"reply_count\":3,\"like_count\":19,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"16_1403800044617310210\"]},\"author_id\":\"1139059532\",\"entities\":{\"urls\":[{\"start\":184,\"end\":207,\"url\":\"https://t.co/WnTLVbvECr\",\"expanded_url\":\"https://bydata.github.io/ichbinhanna/wordcloud.html\",\"display_url\":\"bydata.github.io/ichbinhanna/wo…\",\"status\":200,\"title\":\"Wordcloud #IchBinHanna\",\"unwound_url\":\"https://bydata.github.io/ichbinhanna/wordcloud.html\"},{\"start\":217,\"end\":240,\"url\":\"https://t.co/joGoVWvCMi\",\"expanded_url\":\"https://twitter.com/_ansgar/status/1403803240110637064/photo/1\",\"display_url\":\"pic.twitter.com/joGoVWvCMi\"}],\"hashtags\":[{\"start\":6,\"end\":18,\"tag\":\"IchbinHanna\"},{\"start\":209,\"end\":216,\"tag\":\"rstats\"}]},\"source\":\"Twitter Web App\",\"text\":\"Unter #IchbinHanna beschreiben Nachwuchswissenschaftler :innen, wie sie sich von einem befristetem Vertrag zum nächsten hangeln müssen.\\n\\nDie 200 häufigsten Wörter aus rund 20k Tweets:\\nhttps://t.co/WnTLVbvECr\\n\\n#rstats https://t.co/joGoVWvCMi\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T19:55:48.000Z\"},{\"conversation_id\":\"1403418934376898562\",\"lang\":\"de\",\"id\":\"1403418934376898562\",\"public_metrics\":{\"retweet_count\":5,\"reply_count\":0,\"like_count\":43,\"quote_count\":1},\"author_id\":\"1236932545356464128\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403309312932462593\"}],\"entities\":{\"urls\":[{\"start\":288,\"end\":311,\"url\":\"https://t.co/DSk9CJSgnC\",\"expanded_url\":\"https://twitter.com/AmreiBahr/status/1403309312932462593\",\"display_url\":\"twitter.com/AmreiBahr/stat…\"}],\"hashtags\":[{\"start\":275,\"end\":287,\"tag\":\"IchbinHanna\"}]},\"context_annotations\":[{\"domain\":{\"id\":\"6\",\"name\":\"Sports Event\"},\"entity\":{\"id\":\"1392081594505068547\",\"name\":\"Denmark vs Finland\"}},{\"domain\":{\"id\":\"26\",\"name\":\"Sports League\",\"description\":\"\"},\"entity\":{\"id\":\"731226165784928260\",\"name\":\"Europe - Soccer\"}},{\"domain\":{\"id\":\"26\",\"name\":\"Sports League\",\"description\":\"\"},\"entity\":{\"id\":\"731226237394243584\",\"name\":\"International - Soccer\"}},{\"domain\":{\"id\":\"26\",\"name\":\"Sports League\",\"description\":\"\"},\"entity\":{\"id\":\"1384518599562301449\",\"name\":\"UEFA European Championship\"}}],\"source\":\"Twitter Web App\",\"text\":\"Hannas Kinder &amp; die Person an ihrer Seite müssen mit ihr umziehen, ihre Freude zurücklassen und sich an neuen Orten zurechtfinden. Hanna muss eine gescheite Kinderbetreuung finden &amp; viel Geduld mit ihren Kindern haben. Es sind langwierige Prozesse, die Kraft kosten. #IchbinHanna https://t.co/DSk9CJSgnC\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T18:28:42.000Z\"},{\"conversation_id\":\"1403616430201901058\",\"lang\":\"de\",\"id\":\"1403616430201901058\",\"public_metrics\":{\"retweet_count\":19,\"reply_count\":5,\"like_count\":260,\"quote_count\":2},\"author_id\":\"1260870565541396480\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":4,\"end\":15,\"tag\":\"WissZeitVG\"},{\"start\":260,\"end\":272,\"tag\":\"IchBinHanna\"}]},\"text\":\"Das #WissZeitVG findet auf alle Wissenschaftler_innen gleichermaßen Anwendung. Wer hier aufmerksam mitliest, stellt schnell fest, dass sämtliche Disziplinen betroffen sind. Die dafür erforderliche Lesekompetenz vermitteln übrigens die Geisteswissenschaften. \\uD83D\\uDE09 #IchBinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T07:33:29.000Z\"},{\"conversation_id\":\"1403301870119141377\",\"lang\":\"de\",\"id\":\"1403301870119141377\",\"public_metrics\":{\"retweet_count\":10,\"reply_count\":2,\"like_count\":34,\"quote_count\":2},\"attachments\":{\"media_keys\":[\"3_1403295732438818823\"]},\"author_id\":\"1116502891\",\"entities\":{\"urls\":[{\"start\":251,\"end\":274,\"url\":\"https://t.co/Vzl5xgHnpk\",\"expanded_url\":\"https://www.boeckler.de/de/magazin-mitbestimmung-2744-solidaritaet-kommt-zu-kurz-33410.htm\",\"display_url\":\"boeckler.de/de/magazin-mit…\"},{\"start\":275,\"end\":298,\"url\":\"https://t.co/ho9jk5hbe7\",\"expanded_url\":\"https://twitter.com/boeckler_de/status/1403301870119141377/photo/1\",\"display_url\":\"pic.twitter.com/ho9jk5hbe7\"}],\"hashtags\":[{\"start\":3,\"end\":15,\"tag\":\"IchBinHanna\"},{\"start\":237,\"end\":249,\"tag\":\"Solidarität\"}]},\"source\":\"Twitter Web App\",\"text\":\"Zu #IchBinHanna und prekärer Arbeit an Unis: »Das ist eben Wissenschaft – ein Kampf. Da mussten wir alle durch.« Genau das sei ein Problem, so Mia Feldmann, aufgrund dieser »Akademiker-Romantik« ändere sich nichts. Sie wünscht sich mehr #Solidarität:\\nhttps://t.co/Vzl5xgHnpk https://t.co/ho9jk5hbe7\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T10:43:32.000Z\"},{\"conversation_id\":\"1403307832594812929\",\"lang\":\"de\",\"id\":\"1403307832594812929\",\"public_metrics\":{\"retweet_count\":7,\"reply_count\":6,\"like_count\":70,\"quote_count\":1},\"author_id\":\"935643579862708226\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":69,\"end\":81,\"tag\":\"IchBinHanna\"}]},\"text\":\"Mir stellt sich nur noch eine Frage: wer scrapt nun alle Daten unter #IchBinHanna und macht daraus eine schöne Analyse und schickt sie ans Ministerium?\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T11:07:14.000Z\"},{\"entities\":{\"mentions\":[{\"start\":14,\"end\":24,\"username\":\"BMBF_Bund\"}],\"urls\":[{\"start\":264,\"end\":287,\"url\":\"https://t.co/c8lUrPdYLU\",\"expanded_url\":\"https://www.bmbf.de/de/media-video-16944.html\",\"display_url\":\"bmbf.de/de/media-video…\"}],\"hashtags\":[{\"start\":251,\"end\":263,\"tag\":\"IchbinHanna\"}]},\"conversation_id\":\"1403256687620931590\",\"lang\":\"de\",\"id\":\"1403256687620931590\",\"public_metrics\":{\"retweet_count\":42,\"reply_count\":19,\"like_count\":296,\"quote_count\":4},\"author_id\":\"743152200281632768\",\"source\":\"Twitter Web App\",\"text\":\"Das Video vom @BMBF_Bund ist der Hammer. Es verteidigt ein System, das ausgezeichnete Leute aus der Wissenschaft treibt &amp; viele weitere (vollkommen unnötig)in prekäre Verhältnisse bringt. Außer dem Ministerium verteidigt das kaum jemand mehr\\n-&gt;#IchbinHanna\\nhttps://t.co/c8lUrPdYLU\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T07:44:00.000Z\"},{\"conversation_id\":\"1403504215784308736\",\"lang\":\"de\",\"id\":\"1403504215784308736\",\"public_metrics\":{\"retweet_count\":8,\"reply_count\":3,\"like_count\":47,\"quote_count\":3},\"author_id\":\"1368312532067356676\",\"entities\":{\"urls\":[{\"start\":149,\"end\":172,\"url\":\"https://t.co/oMqryOdwZM\",\"expanded_url\":\"https://www.blaetter.de/ausgabe/2016/august/exzellente-entqualifizierung-das-neue-akademische-prekariat\",\"display_url\":\"blaetter.de/ausgabe/2016/a…\"}],\"hashtags\":[{\"start\":119,\"end\":147,\"tag\":\"ExzellenteEntqualifizierung\"},{\"start\":256,\"end\":268,\"tag\":\"IchbinHanna\"}]},\"source\":\"Twitter Web App\",\"text\":\"Vor fünf Jahren schrieb ich erschöpft und wütend einen Artikel in den Blättern für deutsche und internationale Politik #ExzellenteEntqualifizierung (https://t.co/oMqryOdwZM) - und habe seitdem gelernt: nur wenn wir uns organisieren, haben wir eine Chance. #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T00:07:35.000Z\"},{\"entities\":{\"mentions\":[{\"start\":105,\"end\":115,\"username\":\"BMBF_Bund\"}],\"hashtags\":[{\"start\":250,\"end\":261,\"tag\":\"WissZeitVG\"},{\"start\":262,\"end\":274,\"tag\":\"IchbinHanna\"}]},\"conversation_id\":\"1403621243652382722\",\"lang\":\"de\",\"id\":\"1403621243652382722\",\"public_metrics\":{\"retweet_count\":13,\"reply_count\":3,\"like_count\":56,\"quote_count\":1},\"author_id\":\"434058296\",\"source\":\"Twitter Web App\",\"text\":\"Man muss ehrlich sein: die meisten wiss. Mitarbeiter sind nicht organisiert. Wir haben 2014 in einer vom @BMBF_Bund  (!) finanzierten Studie gezeigt, dass wesentliche Teile univ. Lehre durch den befristet beschäftigten Mittelbau getragen werden. 1/3\\n#WissZeitVG #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T07:52:37.000Z\"},{\"conversation_id\":\"1403733326679187459\",\"lang\":\"de\",\"id\":\"1403733326679187459\",\"public_metrics\":{\"retweet_count\":8,\"reply_count\":2,\"like_count\":146,\"quote_count\":0},\"author_id\":\"566716347\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":257,\"end\":269,\"tag\":\"IchbinHanna\"}]},\"text\":\"Ich bin Carmen,39,promovierte Politikwissenschaftlerin,forsche zu globalen Normdynamiken. Stelle als Akad. Rätin auf Zeit ergattert. Was nach Habil kommt? Keine Ahnung. Aber seit  Kind Nr. 2 da ist, hab ich beschlossen, am Wochenende nicht mehr zu arbeiten #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T15:17:59.000Z\"},{\"conversation_id\":\"1403671176191352839\",\"lang\":\"de\",\"id\":\"1403671176191352839\",\"public_metrics\":{\"retweet_count\":5,\"reply_count\":1,\"like_count\":15,\"quote_count\":0},\"author_id\":\"2976165922\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403668953050791940\"}],\"entities\":{\"urls\":[{\"start\":283,\"end\":306,\"url\":\"https://t.co/sXgJDb2Vxx\",\"expanded_url\":\"https://twitter.com/georg_fischer_/status/1403668953050791940\",\"display_url\":\"twitter.com/georg_fischer_…\"}],\"hashtags\":[{\"start\":212,\"end\":224,\"tag\":\"IchbinHanna\"}]},\"source\":\"Twitter for Android\",\"text\":\"Ich glaube, akadem. Ellenbogen-Ethos gepaart mit Loyalität gegenüber Vorgesetzten verhindert letzendlich eine breite Solidarisierung und gewerkschaftliche Organisation. Aber: Nichts, was sich nicht ändern ließe. #IchbinHanna schafft hoffentlich breite Wahrnehmung &amp; Schub dafür. https://t.co/sXgJDb2Vxx\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T11:11:02.000Z\"},{\"conversation_id\":\"1403311739572310020\",\"lang\":\"de\",\"id\":\"1403311739572310020\",\"public_metrics\":{\"retweet_count\":13,\"reply_count\":2,\"like_count\":153,\"quote_count\":0},\"author_id\":\"2836752629\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":262,\"end\":274,\"tag\":\"IchbinHanna\"}]},\"text\":\"Björn, Arbeiterkind, Ausbildung mit 16 angefangen, Abitur auf 2. Bildungsweg, 9 Jahre Studium, Arbeitlos, Buch veröffentlicht, 2 J. Exposé schreiben als Lastwagenfahrer (!) in einer Kunstspedition, 3 J. Graduiertenkolleg, Diss. zur Kulturpraktik des Schreibens… #IchbinHanna 1/2\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T11:22:45.000Z\"},{\"conversation_id\":\"1403799719072210945\",\"lang\":\"de\",\"id\":\"1403799719072210945\",\"public_metrics\":{\"retweet_count\":2,\"reply_count\":0,\"like_count\":6,\"quote_count\":0},\"author_id\":\"372251987\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403768015099924491\"}],\"entities\":{\"urls\":[{\"start\":17,\"end\":40,\"url\":\"https://t.co/LKDw5yTE3g\",\"expanded_url\":\"https://bit.ly/3cCGO7v\",\"display_url\":\"bit.ly/3cCGO7v\"},{\"start\":285,\"end\":308,\"url\":\"https://t.co/BiH7Unngd2\",\"expanded_url\":\"https://twitter.com/brittaluciaida1/status/1403768015099924491\",\"display_url\":\"twitter.com/brittaluciaida…\"}],\"hashtags\":[{\"start\":108,\"end\":120,\"tag\":\"IchBinHanna\"}]},\"source\":\"Twitter Web App\",\"text\":\"Unbedingt lesen: https://t.co/LKDw5yTE3g – das einzige, was sich vielleicht, auch gerade mit dem Hashtag zu #IchBinHanna (&amp;ähnlichen) geändert hat ist, dass es d. angesprochene \\\"Privatisierung des Leids\\\" so durchgehend zum Glück nicht mehr gibt. Ansonsten: erschreckend zutreffend https://t.co/BiH7Unngd2\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T19:41:49.000Z\"},{\"conversation_id\":\"1403108922005901316\",\"lang\":\"de\",\"id\":\"1403108922005901316\",\"public_metrics\":{\"retweet_count\":7,\"reply_count\":0,\"like_count\":30,\"quote_count\":0},\"author_id\":\"2263445970\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"},{\"start\":21,\"end\":25,\"tag\":\"Uni\"},{\"start\":147,\"end\":157,\"tag\":\"Jobcenter\"},{\"start\":185,\"end\":196,\"tag\":\"Tagesschau\"},{\"start\":211,\"end\":226,\"tag\":\"Grundeinkommen\"}]},\"text\":\"#IchbinHanna \\nAn der #Uni arbeiten hört sich landläufig toll an. Wie viele Menschen dort jedoch langfristig ausgebeutet werden und irgendwann beim #Jobcenter landen, kommt nicht in der #Tagesschau.\\nZeit für das #Grundeinkommen...\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T21:56:50.000Z\"},{\"entities\":{\"mentions\":[{\"start\":17,\"end\":26,\"username\":\"NGA_Wiss\"}],\"urls\":[{\"start\":250,\"end\":273,\"url\":\"https://t.co/rfAJh9Ci5V\",\"expanded_url\":\"https://twitter.com/simoneclaar/status/1403797664622317573\",\"display_url\":\"twitter.com/simoneclaar/st…\"}],\"hashtags\":[{\"start\":87,\"end\":101,\"tag\":\"frististfrust\"}]},\"conversation_id\":\"1403811256910462977\",\"lang\":\"de\",\"id\":\"1403811256910462977\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":5,\"quote_count\":1},\"author_id\":\"1368312532067356676\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403797664622317573\"}],\"source\":\"Twitter Web App\",\"text\":\"Ja, wer sich mit @NGA_Wiss befasst, kommt unweigerlich auf unsere schon 2019 begonnene #frististfrust-Kampagne, unsere laufende Diskussion zu Personalmodellen, die Gegenrevolution des WissZeitVG! Es ist ALLES seit langem angestoßen und angelaufen... https://t.co/rfAJh9Ci5V\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T20:27:39.000Z\"},{\"conversation_id\":\"1403439422671044609\",\"lang\":\"de\",\"id\":\"1403439422671044609\",\"public_metrics\":{\"retweet_count\":3,\"reply_count\":0,\"like_count\":16,\"quote_count\":0},\"author_id\":\"2283287077\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"764911980696047618\"}],\"entities\":{\"urls\":[{\"start\":29,\"end\":52,\"url\":\"https://t.co/ix8vBa0C3X\",\"expanded_url\":\"https://twitter.com/blaetter/status/764911980696047618\",\"display_url\":\"twitter.com/blaetter/statu…\"}],\"hashtags\":[{\"start\":13,\"end\":25,\"tag\":\"IchBinHanna\"}]},\"source\":\"Twitter for iPhone\",\"text\":\"Auch das ist #IchBinHanna ⬇️ https://t.co/ix8vBa0C3X\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T19:50:07.000Z\"},{\"conversation_id\":\"1403804392818720775\",\"lang\":\"de\",\"id\":\"1403804392818720775\",\"public_metrics\":{\"retweet_count\":555,\"reply_count\":264,\"like_count\":2057,\"quote_count\":28},\"author_id\":\"36713389\",\"entities\":{\"urls\":[{\"start\":252,\"end\":275,\"url\":\"https://t.co/5i8KdeoABR\",\"expanded_url\":\"https://reitschuster.de/post/scheiss-gate-von-annalena-baerbock/\",\"display_url\":\"reitschuster.de/post/scheiss-g…\"}],\"hashtags\":[{\"start\":30,\"end\":39,\"tag\":\"Baerbock\"},{\"start\":231,\"end\":238,\"tag\":\"Habeck\"}]},\"source\":\"Twitter Web App\",\"text\":\"Man kann Mitleid bekommen mit #Baerbock. Ein Skandal jagt den nächsten, und jetzt verliert sie auch noch die Nerven. Im Irrglauben, ihr Mikro sei abgeschaltet, sagte sie nach ihrer Rede auf dem Nominierungsparteitag im Weggehen zu #Habeck : \\\"Scheiße!\\\" https://t.co/5i8KdeoABR\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T20:00:23.000Z\"},{\"entities\":{\"mentions\":[{\"start\":225,\"end\":234,\"username\":\"gew_bund\"}],\"hashtags\":[{\"start\":235,\"end\":247,\"tag\":\"IchbinHanna\"}]},\"conversation_id\":\"1403738964733927426\",\"lang\":\"de\",\"id\":\"1403738964733927426\",\"public_metrics\":{\"retweet_count\":11,\"reply_count\":0,\"like_count\":56,\"quote_count\":1},\"author_id\":\"1265294301212401664\",\"source\":\"Twitter for iPhone\",\"text\":\"Das WissZeitVG ist auch ein Machtinstrument, das es den Hochschulen erlaubt, regelmäßig unbequemes und kritisches Personal auszusortieren. Das ist einer der Gründe, warum sich das System an den Unis so lange hält. Euer Thema @gew_bund #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T15:40:24.000Z\"},{\"conversation_id\":\"1403809017382813700\",\"lang\":\"de\",\"id\":\"1403809017382813700\",\"public_metrics\":{\"retweet_count\":1,\"reply_count\":1,\"like_count\":13,\"quote_count\":0},\"author_id\":\"2432594054\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":4,\"end\":15,\"tag\":\"WissZeitVG\"},{\"start\":261,\"end\":273,\"tag\":\"IchbinHanna\"}]},\"text\":\"Das #WissZeitVG ist ein hervorragendes Beispiel für eine katastrophale Umsetzung einer an sich guten Idee. Und dass sich der Staat damit etwas erlaubt, was er der Privatwirtschaft verbietet, ist ein Skandal, der jetzt endlich mal größere Aufmerksamkeit erhält. #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T20:18:45.000Z\"},{\"conversation_id\":\"1403290368830017538\",\"lang\":\"de\",\"id\":\"1403290368830017538\",\"public_metrics\":{\"retweet_count\":36,\"reply_count\":6,\"like_count\":315,\"quote_count\":1},\"author_id\":\"1187682452\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":268,\"end\":280,\"tag\":\"IchBinHanna\"}]},\"text\":\"Die Uni hat mir beigebracht, völlig selbstverständlich umsonst zu arbeiten, sogar noch dafür zu BEZAHLEN mein Wissen zu teilen. Im kapitalistischen System bedeutet das: meine Arbeit ist nichts wert. Im neo-liberalen: ICH bin nichts wert! Wird dauern, das zu entlernen #IchBinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T09:57:50.000Z\"},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":12,\"username\":\"simoneclaar\"},{\"start\":13,\"end\":29,\"username\":\"brittaluciaida1\"},{\"start\":30,\"end\":39,\"username\":\"gew_bund\"},{\"start\":40,\"end\":51,\"username\":\"AKellerGEW\"},{\"start\":52,\"end\":59,\"username\":\"_verdi\"},{\"start\":60,\"end\":69,\"username\":\"dgb_news\"},{\"start\":70,\"end\":81,\"username\":\"kassel_uni\"}],\"urls\":[{\"start\":123,\"end\":146,\"url\":\"https://t.co/fFQJw2GcdT\",\"expanded_url\":\"http://frististfrust.net/\",\"display_url\":\"frististfrust.net\"}],\"hashtags\":[{\"start\":107,\"end\":121,\"tag\":\"FrististFrust\"},{\"start\":148,\"end\":160,\"tag\":\"IchbinHanna\"}]},\"in_reply_to_user_id\":\"2990340688\",\"conversation_id\":\"1403776012299689993\",\"lang\":\"de\",\"id\":\"1403801636921909258\",\"public_metrics\":{\"retweet_count\":1,\"reply_count\":0,\"like_count\":6,\"quote_count\":0},\"author_id\":\"842421925624328193\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403797664622317573\"}],\"source\":\"Twitter Web App\",\"text\":\"@simoneclaar @brittaluciaida1 @gew_bund @AKellerGEW @_verdi @dgb_news @kassel_uni Hier nochmal der Link zu #FrististFrust: https://t.co/fFQJw2GcdT \\n#IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T19:49:26.000Z\"},{\"conversation_id\":\"1256197613252153345\",\"lang\":\"en\",\"id\":\"1256197613252153345\",\"public_metrics\":{\"retweet_count\":22,\"reply_count\":21,\"like_count\":161,\"quote_count\":6},\"attachments\":{\"media_keys\":[\"3_1256197608630038530\"]},\"author_id\":\"129026706\",\"entities\":{\"urls\":[{\"start\":99,\"end\":122,\"url\":\"https://t.co/H7qQ6Vgqj5\",\"expanded_url\":\"https://polscieu.ideasoneurope.eu/2020/05/01/why-im-leaving-university-out-of-love-for-academia/\",\"display_url\":\"polscieu.ideasoneurope.eu/2020/05/01/why…\"},{\"start\":123,\"end\":146,\"url\":\"https://t.co/PSIK3CY1BG\",\"expanded_url\":\"https://twitter.com/ronpatz/status/1256197613252153345/photo/1\",\"display_url\":\"pic.twitter.com/PSIK3CY1BG\"}]},\"source\":\"Tweetbot for Mac\",\"text\":\"A blog post I wanted to write for a while:\\n\\n“Why I’m leaving university out of love for academia“\\n\\nhttps://t.co/H7qQ6Vgqj5 https://t.co/PSIK3CY1BG\",\"possibly_sensitive\":false,\"created_at\":\"2020-05-01T12:23:44.000Z\"},{\"conversation_id\":\"1403658575134744583\",\"lang\":\"de\",\"id\":\"1403658575134744583\",\"public_metrics\":{\"retweet_count\":9,\"reply_count\":0,\"like_count\":36,\"quote_count\":1},\"author_id\":\"1260870565541396480\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1354078617517629442\"}],\"entities\":{\"urls\":[{\"start\":283,\"end\":306,\"url\":\"https://t.co/xbHZbKK0hL\",\"expanded_url\":\"https://twitter.com/amreibahr/status/1354078617517629442\",\"display_url\":\"twitter.com/amreibahr/stat…\"}],\"hashtags\":[{\"start\":16,\"end\":28,\"tag\":\"IchBinHanna\"}]},\"source\":\"Twitter for iPhone\",\"text\":\"Im Anschluss an #IchBinHanna gibt es hier einige Diskussionen um die Frage, welche Akteur_innen &amp; Institutionen in welcher Form Verantwortung dafür tragen, etwas gegen Ungerechtigkeiten im Wissenschaftssystem zu unternehmen. Dazu einige philosophische Überlegungen im Thread. ⬇️ https://t.co/xbHZbKK0hL\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T10:20:57.000Z\"},{\"conversation_id\":\"1403631149109366787\",\"lang\":\"de\",\"id\":\"1403631149109366787\",\"public_metrics\":{\"retweet_count\":14,\"reply_count\":3,\"like_count\":109,\"quote_count\":1},\"author_id\":\"1062358028740124672\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":271,\"end\":283,\"tag\":\"IchbinHanna\"}]},\"text\":\"Ich hatte während der Promotionszeit (Romanistik) &amp; danach in sieben Jahren 11 Verträge. Inzwischen bin ich auf einer entfristeten Stelle als akad. Rat gelandet und fange gerade an, wieder freier zu denken. Befristungen fördern keine Innovationen, sondern nur Frust! #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T08:31:58.000Z\"},{\"conversation_id\":\"1403799719072210945\",\"lang\":\"de\",\"id\":\"1403799719072210945\",\"public_metrics\":{\"retweet_count\":2,\"reply_count\":0,\"like_count\":6,\"quote_count\":0},\"author_id\":\"372251987\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403768015099924491\"}],\"entities\":{\"urls\":[{\"start\":17,\"end\":40,\"url\":\"https://t.co/LKDw5yTE3g\",\"expanded_url\":\"https://bit.ly/3cCGO7v\",\"display_url\":\"bit.ly/3cCGO7v\",\"unwound_url\":\"https://www.blaetter.de/ausgabe/2016/august/exzellente-entqualifizierung-das-neue-akademische-prekariat\"},{\"start\":285,\"end\":308,\"url\":\"https://t.co/BiH7Unngd2\",\"expanded_url\":\"https://twitter.com/brittaluciaida1/status/1403768015099924491\",\"display_url\":\"twitter.com/brittaluciaida…\"}],\"hashtags\":[{\"start\":108,\"end\":120,\"tag\":\"IchBinHanna\"}]},\"source\":\"Twitter Web App\",\"text\":\"Unbedingt lesen: https://t.co/LKDw5yTE3g – das einzige, was sich vielleicht, auch gerade mit dem Hashtag zu #IchBinHanna (&amp;ähnlichen) geändert hat ist, dass es d. angesprochene \\\"Privatisierung des Leids\\\" so durchgehend zum Glück nicht mehr gibt. Ansonsten: erschreckend zutreffend https://t.co/BiH7Unngd2\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T19:41:49.000Z\"},{\"conversation_id\":\"1403803240110637064\",\"lang\":\"de\",\"id\":\"1403803240110637064\",\"public_metrics\":{\"retweet_count\":5,\"reply_count\":3,\"like_count\":19,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"16_1403800044617310210\"]},\"author_id\":\"1139059532\",\"entities\":{\"urls\":[{\"start\":184,\"end\":207,\"url\":\"https://t.co/WnTLVbvECr\",\"expanded_url\":\"https://bydata.github.io/ichbinhanna/wordcloud.html\",\"display_url\":\"bydata.github.io/ichbinhanna/wo…\"},{\"start\":217,\"end\":240,\"url\":\"https://t.co/joGoVWvCMi\",\"expanded_url\":\"https://twitter.com/_ansgar/status/1403803240110637064/photo/1\",\"display_url\":\"pic.twitter.com/joGoVWvCMi\"}],\"hashtags\":[{\"start\":6,\"end\":18,\"tag\":\"IchbinHanna\"},{\"start\":209,\"end\":216,\"tag\":\"rstats\"}]},\"source\":\"Twitter Web App\",\"text\":\"Unter #IchbinHanna beschreiben Nachwuchswissenschaftler :innen, wie sie sich von einem befristetem Vertrag zum nächsten hangeln müssen.\\n\\nDie 200 häufigsten Wörter aus rund 20k Tweets:\\nhttps://t.co/WnTLVbvECr\\n\\n#rstats https://t.co/joGoVWvCMi\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T19:55:48.000Z\"},{\"conversation_id\":\"1403643875248558082\",\"lang\":\"de\",\"id\":\"1403643875248558082\",\"public_metrics\":{\"retweet_count\":14,\"reply_count\":5,\"like_count\":101,\"quote_count\":2},\"author_id\":\"848904266538504193\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":213,\"end\":225,\"tag\":\"IchbinHanna\"},{\"start\":227,\"end\":240,\"tag\":\"Arbeiterkind\"},{\"start\":241,\"end\":254,\"tag\":\"IchbinJelena\"}]},\"text\":\"Mit was für einer Arroganz einem vorgeworfen wird, dass man doch selbst schuld sei, sich für die Wissenschaft entschieden zu haben. Sorry, Horst, meine Eltern sind keine Akademiker*innen. Ich hatte keine Ahnung.\\n\\n#IchbinHanna \\n#Arbeiterkind\\n#IchbinJelena\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T09:22:32.000Z\"},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":12,\"username\":\"StudioDisko\"}],\"hashtags\":[{\"start\":236,\"end\":248,\"tag\":\"IchbinHanna\"}]},\"in_reply_to_user_id\":\"848904266538504193\",\"conversation_id\":\"1403643875248558082\",\"lang\":\"de\",\"id\":\"1403806836269191169\",\"public_metrics\":{\"retweet_count\":1,\"reply_count\":0,\"like_count\":21,\"quote_count\":0},\"author_id\":\"1062831254\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403643875248558082\"}],\"source\":\"Twitter for Android\",\"text\":\"@StudioDisko Dieser Vorwurf geht auch einfach an der Sache vorbei. In keinem Job sollten die Arbeitsbedingungen schlecht sein. Ob man sich für ihn entscheidet oder nicht, tut nix zur Sache, dass auf Missständen aufmerksam gemacht wird! #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T20:10:05.000Z\"},{\"entities\":{\"mentions\":[{\"start\":193,\"end\":203,\"username\":\"BMBF_Bund\"}],\"urls\":[{\"start\":220,\"end\":243,\"url\":\"https://t.co/EZ8YN1X1JA\",\"expanded_url\":\"https://www.bmbf.de/de/media-video-16944.html\",\"display_url\":\"bmbf.de/de/media-video…\"}],\"hashtags\":[{\"start\":6,\"end\":18,\"tag\":\"IchbinHanna\"},{\"start\":245,\"end\":256,\"tag\":\"WissZeitVG\"}]},\"conversation_id\":\"1402944618233217027\",\"lang\":\"de\",\"id\":\"1402944618233217027\",\"public_metrics\":{\"retweet_count\":797,\"reply_count\":35,\"like_count\":1741,\"quote_count\":90},\"author_id\":\"1329509098656833536\",\"source\":\"TweetDeck\",\"text\":\"Unter #IchbinHanna teilen momentan (Nachwuchs)wissenschaftler:innen ihren prekären Status als (befristet) Angestellte in der Wissenschaft. Der Ursprung des Hashtags ist auf folgendes Video des @BMBF_Bund zurückzuführen: https://t.co/EZ8YN1X1JA\\n\\n#WissZeitVG\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T11:03:57.000Z\"},{\"entities\":{\"mentions\":[{\"start\":183,\"end\":193,\"username\":\"BMBF_Bund\"}],\"urls\":[{\"start\":112,\"end\":135,\"url\":\"https://t.co/oFpmPvbyOn\",\"expanded_url\":\"https://www.bmbf.de/de/media-video-16944.html\",\"display_url\":\"bmbf.de/de/media-video…\"}],\"hashtags\":[{\"start\":4,\"end\":15,\"tag\":\"WissZeitVG\"},{\"start\":137,\"end\":152,\"tag\":\"95vsWissZeitVG\"},{\"start\":153,\"end\":181,\"tag\":\"ACertainDegreeofFlexibility\"}]},\"conversation_id\":\"1402595115043115008\",\"lang\":\"de\",\"id\":\"1402595115043115008\",\"public_metrics\":{\"retweet_count\":188,\"reply_count\":91,\"like_count\":842,\"quote_count\":155},\"author_id\":\"730098730943324162\",\"source\":\"Twitter Web App\",\"text\":\"Das #WissZeitVG als Abführmittel der Wissenschaft? Wehe, wenn eine Generation \\\"alle Stellen verstopft\\\" (01:08)! https://t.co/oFpmPvbyOn.\\n#95vsWissZeitVG #ACertainDegreeofFlexibility \\n@BMBF_Bund\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-09T11:55:09.000Z\"},{\"conversation_id\":\"1403384545496424451\",\"lang\":\"de\",\"id\":\"1403384545496424451\",\"public_metrics\":{\"retweet_count\":14,\"reply_count\":1,\"like_count\":189,\"quote_count\":1},\"attachments\":{\"media_keys\":[\"3_1403384308124078082\"]},\"author_id\":\"1096491688657371137\",\"entities\":{\"urls\":[{\"start\":241,\"end\":264,\"url\":\"https://t.co/abyvALlTz7\",\"expanded_url\":\"https://twitter.com/F_Vogelmann/status/1403384545496424451/photo/1\",\"display_url\":\"pic.twitter.com/abyvALlTz7\"}],\"hashtags\":[{\"start\":90,\"end\":101,\"tag\":\"WissZeitVG\"},{\"start\":228,\"end\":240,\"tag\":\"IchbinHanna\"}]},\"source\":\"Twitter Web App\",\"text\":\"Ich bin Frieder, 39, habilitierter Philosoph. Meine Zeit ist abgelaufen – jedenfalls laut #WissZeitVG. Mein Glück, mein Privileg in diesem irrwitzigen System ist, dass ich mich derzeit von Vertretung zu Vertretung hangeln kann. #IchbinHanna https://t.co/abyvALlTz7\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T16:12:03.000Z\"},{\"conversation_id\":\"1402953258277257217\",\"lang\":\"de\",\"id\":\"1402953258277257217\",\"public_metrics\":{\"retweet_count\":15,\"reply_count\":5,\"like_count\":273,\"quote_count\":1},\"author_id\":\"4835412142\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":266,\"end\":278,\"tag\":\"IchbinHanna\"}]},\"text\":\"Ich bin Gabriela. Ich bin Psychologin und Neurowissenschaftlerin. Nach 12 Jahren auf befristeten Verträgen habe ich mich entschieden, die aktive Wissenschaft zu verlassen. U.a, da der Druck und die mangelnden Perspektiven sich schwer mit Familie vereinbaren lassen. #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T11:38:17.000Z\"},{\"conversation_id\":\"1402956953433825283\",\"lang\":\"de\",\"id\":\"1402956953433825283\",\"public_metrics\":{\"retweet_count\":14,\"reply_count\":0,\"like_count\":237,\"quote_count\":1},\"attachments\":{\"media_keys\":[\"3_1402953968788119555\"]},\"author_id\":\"3033091043\",\"entities\":{\"urls\":[{\"start\":297,\"end\":320,\"url\":\"https://t.co/9UxLs9AnRx\",\"expanded_url\":\"https://twitter.com/maxkrahe/status/1402956953433825283/photo/1\",\"display_url\":\"pic.twitter.com/9UxLs9AnRx\"}],\"hashtags\":[{\"start\":284,\"end\":296,\"tag\":\"IchBinHanna\"}]},\"context_annotations\":[{\"domain\":{\"id\":\"65\",\"name\":\"Interests and Hobbies Vertical\",\"description\":\"Top level interests and hobbies groupings, like Food or Travel\"},\"entity\":{\"id\":\"847529762566230016\",\"name\":\"Business and finance\",\"description\":\"Business\"}},{\"domain\":{\"id\":\"66\",\"name\":\"Interests and Hobbies Category\",\"description\":\"A grouping of interests and hobbies entities, like Novelty Food or Destinations\"},\"entity\":{\"id\":\"847888632711061504\",\"name\":\"Personal finance\",\"description\":\"Personal finance\"}},{\"domain\":{\"id\":\"67\",\"name\":\"Interests and Hobbies\",\"description\":\"Interests, opinions, and behaviors of individuals, groups, or cultures; like Speciality Cooking or Theme Parks\"},\"entity\":{\"id\":\"847894794080722944\",\"name\":\"Retirement planning\",\"description\":\"Retirement planning\"}},{\"domain\":{\"id\":\"67\",\"name\":\"Interests and Hobbies\",\"description\":\"Interests, opinions, and behaviors of individuals, groups, or cultures; like Speciality Cooking or Theme Parks\"},\"entity\":{\"id\":\"1037075567227494400\",\"name\":\"Saving and finance\",\"description\":\"Saving and Finance\"}}],\"source\":\"Twitter Web App\",\"text\":\"Ich bin Max, 33 Jahre alt, Ökonom &amp; Politikwissenschaftler. Arbeite zu Demokratie &amp; Kapitalismus, Sustainable Finance + die 70er, &amp; das für mein Leben gern. Bin Postdoc im 2. Jahr WissZeitVG, hab keine Ahnung (&amp; viel Sorge) ob ich je was Unbefristetes bekommen werde. #IchBinHanna https://t.co/9UxLs9AnRx\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T11:52:58.000Z\"},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":12,\"username\":\"VikingRohan\"},{\"start\":13,\"end\":25,\"username\":\"RolandTichy\"}]},\"in_reply_to_user_id\":\"1097754070570491906\",\"conversation_id\":\"1403675153788248072\",\"lang\":\"de\",\"id\":\"1403800862326235141\",\"public_metrics\":{\"retweet_count\":1,\"reply_count\":3,\"like_count\":5,\"quote_count\":0},\"author_id\":\"1365238130043928581\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403800332728217600\"}],\"source\":\"Twitter for Android\",\"text\":\"@VikingRohan @RolandTichy Er hat sich noch nicht gemeldet.\\n\\nAber so abwegig ist das gar nicht.\\n\\nDu schreibst tolle Sachen.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T19:46:21.000Z\"},{\"conversation_id\":\"1402944021790658560\",\"lang\":\"de\",\"id\":\"1402944021790658560\",\"public_metrics\":{\"retweet_count\":10,\"reply_count\":36,\"like_count\":233,\"quote_count\":7},\"attachments\":{\"media_keys\":[\"3_1402944019123085318\"]},\"author_id\":\"39612464\",\"entities\":{\"urls\":[{\"start\":266,\"end\":289,\"url\":\"https://t.co/eRXmu2WAxj\",\"expanded_url\":\"https://twitter.com/thiliel/status/1402944021790658560/photo/1\",\"display_url\":\"pic.twitter.com/eRXmu2WAxj\"}],\"hashtags\":[{\"start\":253,\"end\":265,\"tag\":\"IchBinHanna\"}]},\"source\":\"Twitter for Android\",\"text\":\"Ich bin Alan (34). Habe 14 Jahre lang studiert und 1 Doktorarbeit über mittelalterliche Literatur geschrieben. Ich hangle mich mit Kettenverträgen+Stipendien durch, Rente was ist das? Ich habe noch 4 Jahre Zeit, bis ich nicht mehr das System verstopfe. #IchBinHanna https://t.co/eRXmu2WAxj\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T11:01:34.000Z\"},{\"conversation_id\":\"1403301926226251781\",\"lang\":\"de\",\"id\":\"1403301926226251781\",\"public_metrics\":{\"retweet_count\":40,\"reply_count\":2,\"like_count\":431,\"quote_count\":3},\"author_id\":\"1396661442\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":18,\"end\":30,\"tag\":\"IchbinHanna\"},{\"start\":50,\"end\":53,\"tag\":\"FF\"}]},\"text\":\"+++ Off-Topic +++ #IchbinHanna ist echt das beste #FF aller Zeiten! So viele spannende Accounts. Merci!\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T10:43:45.000Z\"},{\"entities\":{\"mentions\":[{\"start\":89,\"end\":99,\"username\":\"BMBF_Bund\"}],\"hashtags\":[{\"start\":267,\"end\":279,\"tag\":\"IchbinHanna\"}]},\"conversation_id\":\"1403637298391093249\",\"lang\":\"de\",\"id\":\"1403637298391093249\",\"public_metrics\":{\"retweet_count\":7,\"reply_count\":3,\"like_count\":111,\"quote_count\":1},\"author_id\":\"1265294301212401664\",\"source\":\"Twitter for iPhone\",\"text\":\"Ich bin Willi, Soziologe, 35 Jahre. Als Postdoc habe ich drei Jahre in einem Projekt des @BMBF_Bund gearbeitet. Als ich die Rechtmäßigkeit der Befristung anzweifelte, wurde der Antrag meiner Fakultät auf Verlängerung vom Dezernat Personal abgelehnt. Heute klage ich. #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T08:56:24.000Z\"},{\"conversation_id\":\"1402955133651243010\",\"lang\":\"en\",\"id\":\"1402955133651243010\",\"public_metrics\":{\"retweet_count\":31,\"reply_count\":7,\"like_count\":321,\"quote_count\":4},\"author_id\":\"62849728\",\"source\":\"TweetDeck\",\"entities\":{\"hashtags\":[{\"start\":67,\"end\":79,\"tag\":\"IchBinHanna\"}],\"annotations\":[{\"start\":92,\"end\":102,\"probability\":0.45,\"type\":\"Place\",\"normalized_text\":\"Lehrstuehle\"}]},\"text\":\"In solidarity for the academic precariat in in German Universities #IchBinHanna. Get rid of Lehrstuehle, bloated administrations, and shift to proper tenure track to make German academia great again.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T11:45:44.000Z\"},{\"conversation_id\":\"1403665445065003008\",\"lang\":\"de\",\"id\":\"1403665445065003008\",\"public_metrics\":{\"retweet_count\":12,\"reply_count\":1,\"like_count\":65,\"quote_count\":0},\"author_id\":\"1062831254\",\"context_annotations\":[{\"domain\":{\"id\":\"65\",\"name\":\"Interests and Hobbies Vertical\",\"description\":\"Top level interests and hobbies groupings, like Food or Travel\"},\"entity\":{\"id\":\"834828264786898945\",\"name\":\"Drinks\",\"description\":\"Drinks\"}},{\"domain\":{\"id\":\"66\",\"name\":\"Interests and Hobbies Category\",\"description\":\"A grouping of interests and hobbies entities, like Novelty Food or Destinations\"},\"entity\":{\"id\":\"834828445238431744\",\"name\":\"Generic Drinks\",\"description\":\"Generic Drinks\"}},{\"domain\":{\"id\":\"67\",\"name\":\"Interests and Hobbies\",\"description\":\"Interests, opinions, and behaviors of individuals, groups, or cultures; like Speciality Cooking or Theme Parks\"},\"entity\":{\"id\":\"847866073693081601\",\"name\":\"Liquor and spirits\",\"description\":\"Liquor and spirits\"}}],\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":229,\"end\":241,\"tag\":\"IchbinHanna\"}]},\"text\":\"Finde es faszinierend wie oft \\\"Macht doch mal n Vorschlag &amp; jammert nicht nur rum\\\" kommt. Es gibt viele sehr gute &amp; sehr umsetzbare Vorschläge. Genauso das ist das Problem: Wir können die Umsetzung nur durch Aktionen wie #IchbinHanna beeinflussen.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T10:48:15.000Z\"},{\"conversation_id\":\"1403787997628280847\",\"lang\":\"de\",\"id\":\"1403787997628280847\",\"public_metrics\":{\"retweet_count\":2,\"reply_count\":3,\"like_count\":16,\"quote_count\":0},\"author_id\":\"907615723790520320\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403129268754845696\"}],\"entities\":{\"urls\":[{\"start\":253,\"end\":276,\"url\":\"https://t.co/oP0CavzLnI\",\"expanded_url\":\"https://twitter.com/marius_saeltzer/status/1403129268754845696\",\"display_url\":\"twitter.com/marius_saeltze…\"}],\"hashtags\":[{\"start\":211,\"end\":223,\"tag\":\"IchbinHanna\"},{\"start\":224,\"end\":252,\"tag\":\"acertaindegreeofflexibility\"}]},\"source\":\"Twitter Web App\",\"text\":\"Jenseits der sozialen Folgen des WissZeitVG sollten wir uns über die durch akademische Lehre teuer erkauften ,aber nie realisierten Projekte klar werden. Welche Forschung ist durch euren Exit verloren gegangen? #IchbinHanna #acertaindegreeofflexibility https://t.co/oP0CavzLnI\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T18:55:14.000Z\"},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":16,\"username\":\"brittaluciaida1\"},{\"start\":17,\"end\":26,\"username\":\"gew_bund\"},{\"start\":27,\"end\":38,\"username\":\"AKellerGEW\"},{\"start\":39,\"end\":48,\"username\":\"NGA_Wiss\"},{\"start\":105,\"end\":114,\"username\":\"NGA_Wiss\"},{\"start\":115,\"end\":122,\"username\":\"_verdi\"},{\"start\":127,\"end\":136,\"username\":\"gew_bund\"},{\"start\":267,\"end\":276,\"username\":\"dgb_news\"},{\"start\":297,\"end\":308,\"username\":\"kassel_uni\"}],\"hashtags\":[{\"start\":77,\"end\":91,\"tag\":\"frististfrust\"}]},\"in_reply_to_user_id\":\"1368312532067356676\",\"conversation_id\":\"1403776012299689993\",\"lang\":\"de\",\"id\":\"1403797664622317573\",\"public_metrics\":{\"retweet_count\":2,\"reply_count\":1,\"like_count\":9,\"quote_count\":1},\"author_id\":\"2990340688\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403781482238390277\"}],\"source\":\"Twitter for iPhone\",\"text\":\"@brittaluciaida1 @gew_bund @AKellerGEW @NGA_Wiss Es gab nicht ohne Grund die #frististfrust Kampagne von @NGA_Wiss @_verdi und @gew_bund. Allerdings ist die Mehrzahl der Betroffenen bis heute nicht organisiert, und das muss sich ändern. Für mich geht das nur mit den @dgb_news Gewerkschaften. Und @kassel_uni ist ein gutes Bsp\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T19:33:39.000Z\"},{\"conversation_id\":\"1403670170413961217\",\"lang\":\"de\",\"id\":\"1403670170413961217\",\"public_metrics\":{\"retweet_count\":16,\"reply_count\":1,\"like_count\":121,\"quote_count\":0},\"author_id\":\"1260870565541396480\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":272,\"end\":284,\"tag\":\"IchBinHanna\"}]},\"text\":\"Um Hanna faire Arbeitsbedingungen zu ermöglichen sowie Forschung/Lehre nachhaltig zu gestalten, braucht es nicht nur taugliche gesetzliche Grundlagen, sondern auch solide Grundfinanzierung der Hochschulen statt projektförmiger &amp; damit selbst befristeter Finanzierung. #IchBinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T11:07:02.000Z\"},{\"conversation_id\":\"1403650427758026755\",\"lang\":\"de\",\"id\":\"1403650427758026755\",\"public_metrics\":{\"retweet_count\":10,\"reply_count\":2,\"like_count\":81,\"quote_count\":0},\"author_id\":\"800391501477867523\",\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":11,\"end\":23,\"tag\":\"IchBinHanna\"}]},\"text\":\"Was mir am #IchBinHanna - Video auffällt: dass die Lehre mit keinem Wort erwähnt wird. Fast als hätte das mit Wissenschaft nicht viel zu tun.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T09:48:35.000Z\"},{\"conversation_id\":\"1403735804787232775\",\"lang\":\"de\",\"id\":\"1403735804787232775\",\"public_metrics\":{\"retweet_count\":7,\"reply_count\":0,\"like_count\":11,\"quote_count\":1},\"author_id\":\"1352980323521470467\",\"entities\":{\"urls\":[{\"start\":135,\"end\":158,\"url\":\"https://t.co/h0CBlzSjZQ\",\"expanded_url\":\"https://ueberstrom.net/2021/06/12/ich-bin-kathrin-ich-bin-biologin-und-ichbinhanna-eine-prekaere-verstopfung-des-wissenschaftssystems/\",\"display_url\":\"ueberstrom.net/2021/06/12/ich…\"}],\"hashtags\":[{\"start\":5,\"end\":17,\"tag\":\"IchBinHanna\"}]},\"source\":\"Twitter Web App\",\"text\":\"Dass #IchBinHanna genauso für Naturwissenschaften gilt, beschreibt die Biologin und Autorin Dr. Kathrin Marter sehr eindringlich hier: https://t.co/h0CBlzSjZQ\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T15:27:50.000Z\"},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":16,\"username\":\"Gonzoweirdworld\"}],\"hashtags\":[{\"start\":32,\"end\":44,\"tag\":\"IchbinHanna\"}]},\"in_reply_to_user_id\":\"2354561106\",\"conversation_id\":\"1403671176191352839\",\"lang\":\"de\",\"id\":\"1403789064780845066\",\"public_metrics\":{\"retweet_count\":1,\"reply_count\":2,\"like_count\":6,\"quote_count\":0},\"author_id\":\"2976165922\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403673766392123392\"}],\"source\":\"Twitter for Android\",\"text\":\"@Gonzoweirdworld Ja, unbedingt. #IchbinHanna hat da auch schon einiges sichtbar gemacht, schon allein deswegen ist die Initiative wertvoll. Es trägt wirklich mitunter Züge von Feudalherrschaft.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T18:59:28.000Z\"},{\"conversation_id\":\"1403283658694443010\",\"lang\":\"de\",\"id\":\"1403283658694443010\",\"public_metrics\":{\"retweet_count\":24,\"reply_count\":3,\"like_count\":329,\"quote_count\":2},\"author_id\":\"1278718023726239745\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":183,\"end\":194,\"tag\":\"WissZeitVG\"},{\"start\":266,\"end\":278,\"tag\":\"IchbinHanna\"}]},\"text\":\"Ich bin Jule, Philosophin, meine Ex-Partnerin und ich haben auf Familienplanung verzichtet, weil die Unsicherheit schlichtweg zu groß war, in wenigen Jahren läuft meine Zeit nach dem #WissZeitVG ab – womöglich waren all die Opfer für die Forschung völlig vergeblich.#IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T09:31:10.000Z\"},{\"entities\":{\"mentions\":[{\"start\":200,\"end\":210,\"username\":\"AmreiBahr\"},{\"start\":212,\"end\":227,\"username\":\"SebastianKubon\"}],\"urls\":[{\"start\":237,\"end\":260,\"url\":\"https://t.co/Q5QJYwMoQ4\",\"expanded_url\":\"https://zeitgeschichte-online.de/node/58477\",\"display_url\":\"zeitgeschichte-online.de/node/58477\"}],\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"}]},\"conversation_id\":\"1403241144968953861\",\"lang\":\"de\",\"id\":\"1403241144968953861\",\"public_metrics\":{\"retweet_count\":39,\"reply_count\":10,\"like_count\":173,\"quote_count\":3},\"author_id\":\"730098730943324162\",\"source\":\"Twitter Web App\",\"text\":\"#IchbinHanna bedeutet auch, dass Zwischenphasen zwischen zwei Arbeitsverträgen/Stipendien mit ALG I und II überbrückt werden müssen. Forschung finanziert auch die Arbeitsagentur. Der neue Artikel von @AmreiBahr, @SebastianKubon und mir: https://t.co/Q5QJYwMoQ4.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T06:42:14.000Z\"},{\"entities\":{\"mentions\":[{\"start\":33,\"end\":42,\"username\":\"gew_bund\"}],\"urls\":[{\"start\":225,\"end\":248,\"url\":\"https://t.co/YWl3zwRgrT\",\"expanded_url\":\"https://www.gew.de/mitglied-werden/\",\"display_url\":\"gew.de/mitglied-werde…\",\"images\":[{\"url\":\"https://pbs.twimg.com/news_img/1401833408632872962/c0T-i907?format=png&name=orig\",\"width\":750,\"height\":422},{\"url\":\"https://pbs.twimg.com/news_img/1401833408632872962/c0T-i907?format=png&name=150x150\",\"width\":150,\"height\":150}],\"status\":200,\"title\":\"Mitglied werden : GEW - Die Bildungsgewerkschaft\",\"description\":\"Mitglied werden, Mitgliedsantrag, Mitgliedschaft, Gewerkschaft, GEW-Mitglied,\",\"unwound_url\":\"https://www.gew.de/mitglied-werden/\"}],\"hashtags\":[{\"start\":174,\"end\":186,\"tag\":\"IchbinHanna\"},{\"start\":188,\"end\":223,\"tag\":\"HannaistjetztGewerkschaftsmitglied\"}]},\"in_reply_to_user_id\":\"759523247734022144\",\"conversation_id\":\"1403628602655182848\",\"lang\":\"de\",\"id\":\"1403661188735643649\",\"public_metrics\":{\"retweet_count\":7,\"reply_count\":0,\"like_count\":19,\"quote_count\":3},\"author_id\":\"759523247734022144\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403628609852555264\"}],\"source\":\"Twitter for iPhone\",\"text\":\"Gemeinsam mit Euch allen und der @gew_bund ist eine andere Hochschule, eine bessere Wissenschaft, ein gutes Leben für uns Wissenschaftler*innen möglich! \\n\\nOrganisiert euch! \\n#IchbinHanna \\n#HannaistjetztGewerkschaftsmitglied\\n\\nhttps://t.co/YWl3zwRgrT\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T10:31:20.000Z\"},{\"conversation_id\":\"1403663948319268869\",\"lang\":\"de\",\"id\":\"1403663948319268869\",\"public_metrics\":{\"retweet_count\":30,\"reply_count\":4,\"like_count\":72,\"quote_count\":2},\"author_id\":\"153064040\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403332292987265024\"}],\"entities\":{\"urls\":[{\"start\":279,\"end\":302,\"url\":\"https://t.co/FCcmt7CxzC\",\"expanded_url\":\"https://twitter.com/claudiusc/status/1403332292987265024\",\"display_url\":\"twitter.com/claudiusc/stat…\"}],\"hashtags\":[{\"start\":266,\"end\":278,\"tag\":\"IchBinHanna\"}]},\"source\":\"Twitter for iPhone\",\"text\":\"Theoretisch kriegt man als Gehörlose*r ab Bachelor keine Dolmetschkosten mehr bezahlt von den Kostenträgern, weil die „Berufsausbildung“ (von der man theoretisch nur Anspruch auf eine! hat) schon „abgeschlossen“ sei. Beim Promovieren ist es afaik noch mal schwerer. #IchBinHanna https://t.co/FCcmt7CxzC\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T10:42:18.000Z\"},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":12,\"username\":\"DrKEichhorn\"},{\"start\":13,\"end\":23,\"username\":\"AmreiBahr\"},{\"start\":24,\"end\":39,\"username\":\"SebastianKubon\"}],\"urls\":[{\"start\":223,\"end\":246,\"url\":\"https://t.co/oMqryOdwZM\",\"expanded_url\":\"https://www.blaetter.de/ausgabe/2016/august/exzellente-entqualifizierung-das-neue-akademische-prekariat\",\"display_url\":\"blaetter.de/ausgabe/2016/a…\",\"unwound_url\":\"https://www.blaetter.de/ausgabe/2016/august/exzellente-entqualifizierung-das-neue-akademische-prekariat\"}]},\"in_reply_to_user_id\":\"730098730943324162\",\"conversation_id\":\"1403241144968953861\",\"lang\":\"de\",\"id\":\"1403768015099924491\",\"public_metrics\":{\"retweet_count\":16,\"reply_count\":4,\"like_count\":49,\"quote_count\":7},\"author_id\":\"1368312532067356676\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403241144968953861\"}],\"source\":\"Twitter Web App\",\"text\":\"@DrKEichhorn @AmreiBahr @SebastianKubon Hartz IV war von Anfang an in die Exzellenzinitiative eingepreist. Wer behauptet - wie beim WissZeitVG - das Ganze sei eigentlich gut gemeint gewesen, ist nicht informiert oder lügt: https://t.co/oMqryOdwZM\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T17:35:50.000Z\"},{\"in_reply_to_user_id\":\"1130451066670256129\",\"conversation_id\":\"1403797315442327552\",\"lang\":\"de\",\"id\":\"1403797681567326211\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":1,\"quote_count\":0},\"author_id\":\"1130451066670256129\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403797512071401474\"}],\"source\":\"Twitter Web App\",\"text\":\"\\\"Dieser Beitrag des Mittelbaus ist nicht offiziell bekannt, weil nicht einmal die Lehrverpflichtung des Mittelbaus zentral dokumentiert wird, im Falle des drittmittelfinanzierten Personals sogar nicht einmal, dass es überhaupt lehrt.\\\"\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T19:33:43.000Z\"},{\"conversation_id\":\"1403037999319994371\",\"lang\":\"de\",\"id\":\"1403037999319994371\",\"public_metrics\":{\"retweet_count\":43,\"reply_count\":4,\"like_count\":450,\"quote_count\":0},\"author_id\":\"114774406\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403033048476700685\"}],\"entities\":{\"urls\":[{\"start\":213,\"end\":236,\"url\":\"https://t.co/9CDTn9zq6n\",\"expanded_url\":\"https://twitter.com/FreihandDenker/status/1403033048476700685\",\"display_url\":\"twitter.com/FreihandDenker…\"}],\"hashtags\":[{\"start\":13,\"end\":25,\"tag\":\"IchbinHanna\"}]},\"source\":\"Twitter Web App\",\"text\":\"So sehr mich #IchbinHanna auch rührt, so sehr erschreckt mich das Ausmaß an Wissenschaftsfeindlichkeit, das vor allem den Geisteswissenschaften hier entgegengebracht wird. Anbei eine großartige Replik. Nuff said. https://t.co/9CDTn9zq6n\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T17:15:00.000Z\"},{\"conversation_id\":\"1403660402626543616\",\"lang\":\"de\",\"id\":\"1403660402626543616\",\"public_metrics\":{\"retweet_count\":26,\"reply_count\":6,\"like_count\":120,\"quote_count\":0},\"author_id\":\"95762373\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403332292987265024\"}],\"entities\":{\"urls\":[{\"start\":230,\"end\":253,\"url\":\"https://t.co/i7Cc0M9vUj\",\"expanded_url\":\"https://twitter.com/ClaudiusC/status/1403332292987265024\",\"display_url\":\"twitter.com/ClaudiusC/stat…\"}],\"hashtags\":[{\"start\":217,\"end\":229,\"tag\":\"IchbinHanna\"}]},\"source\":\"Twitter for Android\",\"text\":\"Nach meinen Gefühl ist das ganze Bildungssystem so Ableistisch, dass die meisten von uns gar nicht so weit kommen. Von uns wenigen traut sich wiederum nur ein kleiner Teil zu promovieren, bzw hat die Energie dazu. :( #IchbinHanna https://t.co/i7Cc0M9vUj\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T10:28:13.000Z\"},{\"conversation_id\":\"1403332292987265024\",\"lang\":\"de\",\"id\":\"1403332292987265024\",\"public_metrics\":{\"retweet_count\":28,\"reply_count\":13,\"like_count\":129,\"quote_count\":5},\"author_id\":\"73942186\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"},{\"start\":218,\"end\":226,\"tag\":\"abelism\"}]},\"text\":\"#IchbinHanna macht gerade auf die prekären Arbeits- und Lebensbediungungen von Wissenschaftler*innen in D  aufmerksam. \\n\\nSoweit ich das beobachte, nehmen vor allem abled, weiße Menschen derzeit dazu Stellung.\\n\\nWieviel #abelism steckt eigentlich im deutschen Hochschulwesen?\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T12:44:25.000Z\"},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":12,\"username\":\"bjoern_krey\"},{\"start\":13,\"end\":25,\"username\":\"Die_Gruenen\"}],\"hashtags\":[{\"start\":76,\"end\":88,\"tag\":\"ichbinhanna\"}]},\"in_reply_to_user_id\":\"764418176671178752\",\"conversation_id\":\"1403637435322482688\",\"lang\":\"de\",\"id\":\"1403790710843789312\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":2,\"like_count\":2,\"quote_count\":0},\"author_id\":\"1133552725\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403790188405575688\"}],\"source\":\"Twitter Web App\",\"text\":\"@bjoern_krey @Die_Gruenen damit hast du die Spannung wieder reingebracht :) #ichbinhanna hat das Thema auf jeden Fall für mich auf die Ebene eines Wahlentscheidungsthemas gehoben. man wird wacher durch sowas.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T19:06:01.000Z\"},{\"entities\":{\"mentions\":[{\"start\":238,\"end\":250,\"username\":\"boeckler_de\"}],\"hashtags\":[{\"start\":267,\"end\":279,\"tag\":\"ichbinHanna\"}]},\"conversation_id\":\"1403242289653293057\",\"lang\":\"de\",\"id\":\"1403242289653293057\",\"public_metrics\":{\"retweet_count\":14,\"reply_count\":1,\"like_count\":152,\"quote_count\":0},\"author_id\":\"822424698831118336\",\"source\":\"Twitter Web App\",\"text\":\"Ich bin Daniel, 43, Familienvater, Professor auf Zeit und ohne Tenure-Option; Drittmittel eingeworben für 1 Mio., 3 Bücher, 5 Sammelbände, 30 Aufsätze, Mitherausgeber einer Zeitschrift, Maria Weber Grant Preisträger, Vertrauensdozent der @boeckler_de, etc. etc. Auch #ichbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T06:46:47.000Z\"},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":12,\"username\":\"LeberJohnny\"},{\"start\":13,\"end\":25,\"username\":\"Die_Gruenen\"}],\"hashtags\":[{\"start\":197,\"end\":201,\"tag\":\"gew\"}]},\"in_reply_to_user_id\":\"1133552725\",\"conversation_id\":\"1403637435322482688\",\"lang\":\"de\",\"id\":\"1403790188405575688\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":1,\"quote_count\":0},\"author_id\":\"764418176671178752\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403789489986736132\"}],\"source\":\"Twitter for iPhone\",\"text\":\"@LeberJohnny @Die_Gruenen :) wollte Dir die Hoffnung nicht nehmen. Gibt schon Parteien, die sich da klarer positionieren. Und auch einzelne Politiker:innen der Grünen. Meine Hoffnung ist aber auch #gew\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T19:03:56.000Z\"},{\"entities\":{\"mentions\":[{\"start\":86,\"end\":93,\"username\":\"UZH_ch\"}],\"urls\":[{\"start\":268,\"end\":291,\"url\":\"https://t.co/v12Wfr7hZp\",\"expanded_url\":\"https://twitter.com/UlrichtheKaiser/status/1402967915935186946/photo/1\",\"display_url\":\"pic.twitter.com/v12Wfr7hZp\"}],\"hashtags\":[{\"start\":129,\"end\":141,\"tag\":\"IchBinHanna\"}]},\"conversation_id\":\"1402967915935186946\",\"lang\":\"de\",\"id\":\"1402967915935186946\",\"public_metrics\":{\"retweet_count\":46,\"reply_count\":9,\"like_count\":738,\"quote_count\":2},\"attachments\":{\"media_keys\":[\"3_1402967849140957190\"]},\"author_id\":\"1069874259563036672\",\"context_annotations\":[{\"domain\":{\"id\":\"65\",\"name\":\"Interests and Hobbies Vertical\",\"description\":\"Top level interests and hobbies groupings, like Food or Travel\"},\"entity\":{\"id\":\"847529762566230016\",\"name\":\"Business and finance\",\"description\":\"Business\"}},{\"domain\":{\"id\":\"66\",\"name\":\"Interests and Hobbies Category\",\"description\":\"A grouping of interests and hobbies entities, like Novelty Food or Destinations\"},\"entity\":{\"id\":\"857879302733418496\",\"name\":\"Entrepreneurship\",\"description\":\"Entrepreneurship\"}}],\"source\":\"Twitter Web App\",\"text\":\"Ich bin Ulrich, 50, seit 13 Jahren Inhaber des Lehrstuhls für Entrepreneurship an der @UZH_ch.\\n\\n2001 promoviert wollte ich nicht #IchBinHanna werden und bin ins Ausland. Dort bin ich immer noch und wundere mich, dass es in \\uD83C\\uDDE9\\uD83C\\uDDEA in 20 Jahren null Fortschrit gegeben hat. https://t.co/v12Wfr7hZp\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T12:36:31.000Z\"},{\"conversation_id\":\"1403088993420337152\",\"lang\":\"de\",\"id\":\"1403088993420337152\",\"public_metrics\":{\"retweet_count\":224,\"reply_count\":21,\"like_count\":1708,\"quote_count\":13},\"author_id\":\"1360186141861965825\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":8,\"end\":20,\"tag\":\"IchbinHanna\"}]},\"text\":\"Man hat #IchbinHanna übrigens nicht verstanden, wenn man glaubt, dass sich hier die Verlierer:innen eines harten Wettbewerbs über Persönliches beklagen. Es geht in jedem einzelnen Post darum, dass die ggw. Strukturen genuin wissenschafts- und, Achtung: innovationsfeindlich sind.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T20:37:38.000Z\"},{\"entities\":{\"mentions\":[{\"start\":91,\"end\":103,\"username\":\"DrKEichhorn\"},{\"start\":211,\"end\":220,\"username\":\"NGA_Wiss\"}],\"hashtags\":[{\"start\":30,\"end\":42,\"tag\":\"IchbinHanna\"}]},\"conversation_id\":\"1403786999467851780\",\"lang\":\"de\",\"id\":\"1403786999467851780\",\"public_metrics\":{\"retweet_count\":1,\"reply_count\":1,\"like_count\":27,\"quote_count\":0},\"author_id\":\"1368312532067356676\",\"source\":\"Twitter Web App\",\"text\":\"Nun wissen wir endlich, woher #IchbinHanna plötzlich kommt: von uns selbst. Die fabelhafte @DrKEichhorn  aus unserem KO-Kreis hat den hashtag mit ihren Kolleg_innen Amrei Bahr und Sebastian Kubon losgetreten. \\uD83E\\uDD17 @NGA_Wiss\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T18:51:16.000Z\"},{\"conversation_id\":\"1402986251121090583\",\"lang\":\"de\",\"id\":\"1402986251121090583\",\"public_metrics\":{\"retweet_count\":109,\"reply_count\":15,\"like_count\":1278,\"quote_count\":4},\"author_id\":\"713006165697892352\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":266,\"end\":278,\"tag\":\"IchbinHanna\"}]},\"text\":\"Ich bin Gordon, 38 Jahre alt, Psychologe und erforsche den Zusammenhang von Schlaf und Gedächtnis. Ich bin seit 2019 Emmy-Noether-Nachwuchsgruppenleiter und somit von DFG als exzellent gefördert. Dieses Jahr sind meine 12 Jahre um und mein Wert laut BMBF erschöpft. #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T13:49:23.000Z\"},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":15,\"username\":\"georg_fischer_\"}]},\"in_reply_to_user_id\":\"2976165922\",\"conversation_id\":\"1403671176191352839\",\"lang\":\"de\",\"id\":\"1403673766392123392\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":4,\"quote_count\":0},\"author_id\":\"2354561106\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403672437267501060\"}],\"source\":\"Twitter for Android\",\"text\":\"@georg_fischer_ Man kann gerne auch mal über den Umgang mit dem Fussvolk sprechen. Nötigung, Übergriffigkeiten und Erpressung sind keine Seltenheit. O-Ton Professorin: \\\"Kein Geld mehr? kannst ja bei mir Bügeln ich Zahl aber schlecht.\\\" Die Kollegin ging dann in die Wirtschaft.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T11:21:19.000Z\"},{\"conversation_id\":\"1403025837839028229\",\"lang\":\"de\",\"id\":\"1403025837839028229\",\"public_metrics\":{\"retweet_count\":97,\"reply_count\":14,\"like_count\":1530,\"quote_count\":4},\"author_id\":\"41074848\",\"source\":\"TweetDeck\",\"entities\":{\"hashtags\":[{\"start\":263,\"end\":275,\"tag\":\"IchbinHanna\"}]},\"text\":\"Silke, 49, Literaturwissenschaftlerin, verstopft das System seit Oktober auf einer halben unbefristeten Stelle. Sonst hätte ich nach 20 Jahren Wissenschaft, 4 Monografien, 58 Aufsätzen und einer knappen Million eingeworbener Drittmittel auf der Straße gestanden. #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T16:26:41.000Z\"},{\"conversation_id\":\"1403129268754845696\",\"lang\":\"de\",\"id\":\"1403129268754845696\",\"public_metrics\":{\"retweet_count\":11,\"reply_count\":7,\"like_count\":98,\"quote_count\":3},\"author_id\":\"907615723790520320\",\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":239,\"end\":251,\"tag\":\"IchbinHanna\"}]},\"text\":\"Wir hören viele Stimmen von WissenschaftlerInnen die unter dem Wissenschaftszeitvertragsgesetz leiden. Aber was ist mit denen, die schon lange raus sind? Die der Wissenschaft wegen dieser Arbeitsbedingungen bereits verloren gegangen sind? #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T23:17:41.000Z\"},{\"conversation_id\":\"1403376420018167815\",\"lang\":\"de\",\"id\":\"1403376420018167815\",\"public_metrics\":{\"retweet_count\":15,\"reply_count\":0,\"like_count\":76,\"quote_count\":0},\"author_id\":\"824631451199082497\",\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":263,\"end\":275,\"tag\":\"IchbinHanna\"}]},\"text\":\"Das Problem beginnt schon beim Zwang zur \\\"Innovativität\\\" und \\\"Exzellenz\\\". So viel wichtige umd originelle Forschung wird nicht gemacht, weil sie lang dauert und langweilig ist, oder weil sie nicht in Kategorien passt, die eigentlich Nützlichkeitskategorien sind. #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T15:39:46.000Z\"},{\"entities\":{\"mentions\":[{\"start\":33,\"end\":42,\"username\":\"gew_bund\"}],\"urls\":[{\"start\":225,\"end\":248,\"url\":\"https://t.co/YWl3zwRgrT\",\"expanded_url\":\"https://www.gew.de/mitglied-werden/\",\"display_url\":\"gew.de/mitglied-werde…\"}],\"hashtags\":[{\"start\":174,\"end\":186,\"tag\":\"IchbinHanna\"},{\"start\":188,\"end\":223,\"tag\":\"HannaistjetztGewerkschaftsmitglied\"}]},\"in_reply_to_user_id\":\"759523247734022144\",\"conversation_id\":\"1403628602655182848\",\"lang\":\"de\",\"id\":\"1403661188735643649\",\"public_metrics\":{\"retweet_count\":7,\"reply_count\":0,\"like_count\":19,\"quote_count\":3},\"author_id\":\"759523247734022144\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403628609852555264\"}],\"source\":\"Twitter for iPhone\",\"text\":\"Ge