s\":{\"mentions\":[{\"start\":77,\"end\":86,\"username\":\"gew_bund\"},{\"start\":96,\"end\":103,\"username\":\"_verdi\"}],\"hashtags\":[{\"start\":29,\"end\":41,\"tag\":\"IchbinHanna\"}]},\"conversation_id\":\"1403654014059810816\",\"lang\":\"de\",\"id\":\"1403654014059810816\",\"public_metrics\":{\"retweet_count\":3,\"reply_count\":8,\"like_count\":30,\"quote_count\":0},\"author_id\":\"1235933776640962560\",\"source\":\"Twitter Web App\",\"text\":\"In welche Gewerkschaft tritt #IchbinHanna denn nun eigentlich am besten ein? @gew_bund oder bei @_verdi ?\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T10:02:50.000Z\"},{\"conversation_id\":\"1403609304771579904\",\"lang\":\"de\",\"id\":\"1403609304771579904\",\"public_metrics\":{\"retweet_count\":10,\"reply_count\":4,\"like_count\":107,\"quote_count\":1},\"author_id\":\"1074810157916405761\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":84,\"end\":95,\"tag\":\"WissZeitVG\"},{\"start\":96,\"end\":108,\"tag\":\"IchbinHanna\"}]},\"text\":\"Medienaufmerksamkeit für die strukturellen Probleme &amp; die Mobilisierung rund um #WissZeitVG #IchbinHanna ? Auch das zeigt die Missachtung von und Verachtung für academia jenseits der klassischen Professur\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T07:05:10.000Z\"},{\"entities\":{\"mentions\":[{\"start\":114,\"end\":124,\"username\":\"BMBF_Bund\"}],\"hashtags\":[{\"start\":169,\"end\":181,\"tag\":\"IchBinHanna\"}]},\"conversation_id\":\"1403019418318278662\",\"lang\":\"de\",\"id\":\"1403019418318278662\",\"public_metrics\":{\"retweet_count\":66,\"reply_count\":6,\"like_count\":708,\"quote_count\":2},\"author_id\":\"707300634903629824\",\"source\":\"Twitter Web App\",\"text\":\"Ich bin Gregor und verstopfe das System auf einer W3-Stelle. Deshalb bin ich auch so wenig innovativ. Schließlich,@BMBF_Bund, fördert Fluktuation die Innovationskraft. \\n#IchBinHanna und weiß nicht, wer sich solche Sätze ausdenkt. Prekarität fördert Unsicherheit, nicht Innovation.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T16:01:10.000Z\"},{\"entities\":{\"mentions\":[{\"start\":23,\"end\":33,\"username\":\"BMBF_Bund\"}],\"urls\":[{\"start\":158,\"end\":181,\"url\":\"https://t.co/lI3oLi6sxl\",\"expanded_url\":\"https://www.bmbf.de/de/media-video-16944.html\",\"display_url\":\"bmbf.de/de/media-video…\"}],\"hashtags\":[{\"start\":97,\"end\":109,\"tag\":\"IchbinHanna\"}]},\"conversation_id\":\"1403266652553289728\",\"lang\":\"de\",\"id\":\"1403266652553289728\",\"public_metrics\":{\"retweet_count\":14,\"reply_count\":3,\"like_count\":102,\"quote_count\":0},\"author_id\":\"1319695000465178625\",\"source\":\"Twitter Web App\",\"text\":\"»Verstopft?« Bevor das @BMBF_Bund das unerträgliche Video aus der Mediathek nimmt: Das Netz wird #IchbinHanna nicht vergessen. Zeit für grundlegenden Wandel!\\nhttps://t.co/lI3oLi6sxl\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T08:23:36.000Z\"},{\"conversation_id\":\"1403096178011611139\",\"lang\":\"de\",\"id\":\"1403096178011611139\",\"public_metrics\":{\"retweet_count\":113,\"reply_count\":7,\"like_count\":927,\"quote_count\":5},\"author_id\":\"4839586389\",\"source\":\"Twitter for iPhone\",\"entities\":{\"hashtags\":[{\"start\":4,\"end\":16,\"tag\":\"IchbinHanna\"}]},\"text\":\"Die #IchbinHanna Tweets zeigen nicht nur erschütternde persönliche Biographien. Sie zeigen auch eine Ressourcen-&amp; Zukunftsverschwendung in Deutschland, die Scheuer'sche &amp; Spahn'sche Dimensionen noch übertrifft. Die beiden sind zwar auch befristet, sie werden aber sicher versorgt.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T21:06:11.000Z\"},{\"conversation_id\":\"1402987662684823562\",\"lang\":\"de\",\"id\":\"1402987662684823562\",\"public_metrics\":{\"retweet_count\":164,\"reply_count\":29,\"like_count\":2916,\"quote_count\":11},\"author_id\":\"1200384994386104322\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":268,\"end\":280,\"tag\":\"IchBinHanna\"}]},\"text\":\"Ich bin Johanna, Juristin, und habe mit 33 nach meiner summa cum laude-Promotion, Forschungsarbeit u 2 Staatsexamina die zugesagte, befristete Habil-Stelle nicht angetreten, weil mir e unbefristete Stelle in der Wirtschaft angeboten wurde u ich Familienernährerin bin.#IchBinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T13:54:59.000Z\"},{\"conversation_id\":\"1403020765201641477\",\"lang\":\"de\",\"id\":\"1403020765201641477\",\"public_metrics\":{\"retweet_count\":123,\"reply_count\":19,\"like_count\":565,\"quote_count\":5},\"author_id\":\"4727574567\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":20,\"end\":32,\"tag\":\"IchBinHanna\"}]},\"text\":\"Guck euch mal unter #IchBinHanna an, unter welchen Bedingungen junge Wissenschaftler:innen in Deutschland arbeiten. Befristung nach Befristung nach Befristung. \\n\\nUnsicherheit und Ergebnisdruck statt Freiheit der Wissenschaft.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T16:06:31.000Z\"},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":16,\"username\":\"brittaluciaida1\"},{\"start\":17,\"end\":29,\"username\":\"DrKEichhorn\"},{\"start\":30,\"end\":40,\"username\":\"AmreiBahr\"},{\"start\":41,\"end\":56,\"username\":\"SebastianKubon\"}]},\"in_reply_to_user_id\":\"1368312532067356676\",\"conversation_id\":\"1403241144968953861\",\"lang\":\"de\",\"id\":\"1403777060632420360\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":0,\"like_count\":10,\"quote_count\":1},\"author_id\":\"114774406\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403768015099924491\"}],\"source\":\"Twitter for Android\",\"text\":\"@brittaluciaida1 @DrKEichhorn @AmreiBahr @SebastianKubon \\\"Es ist, als nehme man 1 Kind immer wieder d Teddy weg, um ihn dann jedes Jahr 1 bisschen abgefranster wieder unter d Weihnachtsbaum zu legen – in d Erwartung, dass es nichts merkt. Wenn d Kind aber doch etwas merkt, wird es ignoriert oder es wird ihm eingerede