thor_id\":\"312188175\",\"source\":\"Twitter for iPad\",\"entities\":{\"hashtags\":[{\"start\":4,\"end\":16,\"tag\":\"IchBinHanna\"}]},\"text\":\"Die #IchBinHanna Tweets verstören mir heute nachdrücklich. So viele tolle Leute aus so vielen unterschiedlichen Disziplinen. Und so wenig Zukunftsgewissheit trotz exzellenter Leistungen. Das muss sich ändern. Sonst ist Wissenschaft nicht mehr attraktiv. Am Geld liegt’s nicht.\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T19:00:09.000Z\"},{\"conversation_id\":\"1403609758234521602\",\"lang\":\"de\",\"id\":\"1403609758234521602\",\"public_metrics\":{\"retweet_count\":17,\"reply_count\":9,\"like_count\":35,\"quote_count\":2},\"author_id\":\"931921161314807808\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403295148981825536\"}],\"entities\":{\"urls\":[{\"start\":270,\"end\":293,\"url\":\"https://t.co/fpjk9L3rI5\",\"expanded_url\":\"https://twitter.com/gert_woellmann/status/1403295148981825536\",\"display_url\":\"twitter.com/gert_woellmann…\"}],\"hashtags\":[{\"start\":257,\"end\":269,\"tag\":\"IchbinHanna\"}]},\"source\":\"Twitter for iPad\",\"text\":\"Ich bin Lann irgendwas mit 40+ und studiere im 27. Semester die Vulvarisierung der genderfluiden Kohlenstoffeinheit in einer phallozentrischen und anthropozentrischen Gesellschaft. Mein Hobby sind sadomasochistische Anwendungen mit rechtskonformen gendern. #IchbinHanna https://t.co/fpjk9L3rI5\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T07:06:58.000Z\"},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":12,\"username\":\"DrKEichhorn\"},{\"start\":13,\"end\":23,\"username\":\"AmreiBahr\"},{\"start\":24,\"end\":39,\"username\":\"SebastianKubon\"}],\"urls\":[{\"start\":223,\"end\":246,\"url\":\"https://t.co/oMqryOdwZM\",\"expanded_url\":\"https://www.blaetter.de/ausgabe/2016/august/exzellente-entqualifizierung-das-neue-akademische-prekariat\",\"display_url\":\"blaetter.de/ausgabe/2016/a…\"}]},\"in_reply_to_user_id\":\"730098730943324162\",\"conve