67\",\"name\":\"Interests and Hobbies\",\"description\":\"Interests, opinions, and behaviors of individuals, groups, or cultures; like Speciality Cooking or Theme Parks\"},\"entity\":{\"id\":\"847894353708068864\",\"name\":\"Investing\",\"description\":\"Investing\"}}],\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":271,\"end\":283,\"tag\":\"IchbinHanna\"}]},\"text\":\"Es geht ja nicht nur um \\\"Karriere\\\". Wir wollen nur anständig bezahlt unsere Arbeit machen, für die wir 10+ Jahre (aus)gebildet wurden &amp; die gebraucht wird, um die \\uD83C\\uDF0D besser zu verstehen/machen. Wenn man sich so umschaut, sollte man meinen, die Investition lohnt sich. #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T21:34:02.000Z\"},{\"conversation_id\":\"1403494513964879872\",\"lang\":\"de\",\"id\":\"1403494513964879872\",\"public_metrics\":{\"retweet_count\":4,\"reply_count\":1,\"like_count\":33,\"quote_count\":0},\"author_id\":\"272367472\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403492771747569666\"}],\"entities\":{\"urls\":[{\"start\":270,\"end\":293,\"url\":\"https://t.co/dEXzY9NiOa\",\"expanded_url\":\"https://twitter.com/fionnindy/status/1403492771747569666\",\"display_url\":\"twitter.com/fionnindy/stat…\"}],\"hashtags\":[{\"start\":257,\"end\":269,\"tag\":\"IchBinHanna\"}]},\"source\":\"Twitter for iPhone\",\"text\":\"Das Wissenschaftssystem erzeugt künstlich eine Massierung von Arbeitskräften mit leeren Versprechen, um mit dieser Masse dann Prestige und Forschungsmasse zu erzeugen, eine Handvoll zu Nachfolgern auszubilden und den Rest wegzuwerfen. Altliberale Zustände. #IchBinHanna https://t.co/dEXzY9NiOa\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T23:29:02.000Z\"},{\"conversation_id\":\"1403760796161675269\",\"lang\":\"de\",\"id\":\"1403760796161675269\",\"public_metrics\":{\"retweet_count\":5,\"reply_count\":0,\"like_count\":11,\"quote_count\":0},\"author_id\":\"2289479446\",\"entities\":{\"urls\":[{\"start\":179,\"end\":202,\"url\":\"https://t.co/dZj9NRROK0\",\"expanded_url\":\"https://www.bdwi.de/termine/event_30518.html\",\"display_url\":\"bdwi.de/termine/event_…\"}],\"hashtags\":[{\"start\":84,\"end\":95,\"tag\":\"Klassismus\"},{\"start\":100,\"end\":113,\"tag\":\"Wissenschaft\"},{\"start\":234,\"end\":246,\"tag\":\"IchbinHanna\"},{\"start\":263,\"end\":272,\"tag\":\"firstgen\"}]},\"source\":\"Twitter for Android\",\"text\":\"+++ Einladung +++\\n\\nAnna und Martin Shakoor führen gemeinsam mit Zuzana Kobesova in \\\"#Klassismus und #Wissenschaft\\\" ein. \\uD83D\\uDCD5\\uD83E\\uDD1C\\uD83E\\uDD1B\\uD83C\\uDF93\\n\\nWann? Donnerstag, 17.6., 19 Uhr.\\nWeitere Infos hier: https://t.co/dZj9NRROK0\\n\\nInteressanr für alle, die von #IchbinHanna betroffen sind! #firstgen\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T17:07:09.000Z\"},{\"conversation_id\":\"1403280637809905665\",\"lang\":\"de\",\"id\":\"1403280637809905665\",\"public_metrics\":{\"retweet_count\":39,\"reply_count\":4,\"like_count\":165,\"quote_count\":0},\"author_id\":\"585600232\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403273798607065089\"}],\"entities\":{\"urls\":[{\"start\":279,\"end\":302,\"url\":\"https://t.co/D4kPYzv6PV\",\"expanded_url\":\"https://twitter.com/StudioDisko/status/1403273798607065089\",\"display_url\":\"twitter.com/StudioDisko/st…\"}],\"hashtags\":[{\"start\":52,\"end\":64,\"tag\":\"ichbinHanna\"}]},\"source\":\"Twitter Web App\",\"text\":\"Es ist interessant, dass diejenigen, die sich unter #ichbinHanna äußern eben auch nicht Jelenas und Meleks sind. \\n\\nWir müssen auch über\\n*Diversität (inkl. sozialer Herkunft) und\\n* Formen der Dekolonialisierung in unseren Disziplinen\\nsprechen\\n\\nund dass Hanna ziemlich hetero ist. https://t.co/D4kPYzv6PV\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T09:19:10.000Z\"},{\"conversation_id\":\"1403655820911558660\",\"lang\":\"de\",\"id\":\"1403655820911558660\",\"public_metrics\":{\"retweet_count\":3,\"reply_count\":2,\"like_count\":26,\"quote_count\":0},\"author_id\":\"1094275875074379776\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403001273922637828\"}],\"entities\":{\"urls\":[{\"start\":278,\"end\":301,\"url\":\"https://t.co/Op9IlOFak0\",\"expanded_url\":\"https://twitter.com/lordelend/status/1403001273922637828\",\"display_url\":\"twitter.com/lordelend/stat…\"}],\"hashtags\":[{\"start\":265,\"end\":277,\"tag\":\"IchbinHanna\"}]},\"source\":\"Twitter for iPhone\",\"text\":\"Genau das! Permanente Prekarisierung fördert nicht Innovation sondern normative Lebensläufe. Care Arbeit, firstgen academics (da gehöre auch ich dazu), etc bleiben hier unbeachtet. Was es zudem dringend braucht: Solidarität von allen die entfristet/verbeamtet sind #IchbinHanna https://t.co/Op9IlOFak0\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T10:10:01.000Z\"},{\"in_reply_to_user_id\":\"739356083408535552\",\"conversation_id\":\"1403607352939536384\",\"lang\":\"de\",\"id\":\"1403607358140465153\",\"public_metrics\":{\"retweet_count\":10,\"reply_count\":1,\"like_count\":53,\"quote_count\":0},\"author_id\":\"739356083408535552\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403607356286640128\"}],\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":173,\"end\":185,\"tag\":\"ichbinhanna\"}]},\"text\":\"Arbeiter*innenbackground bedeutet auch, dass in meiner Familie Betriebs- und Personalrats- sowie Gewerkschaftsarbeit viel Bedeutung beigemessen wurde. Wie von vielen in der #ichbinhanna-Diskussion schon genannt: Tretet Gewerkschaften bei &amp; organisiert Euch!\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T06:57:26.000Z\"},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":13,\"username\":\"R_Hesselbach\"}]},\"in_reply_to_user_id\":\"1062358028740124672\",\"conversation_id\":\"1403631149109366787\",\"lang\":\"de\",\"id\":\"1403633582145519618\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":2,\"like_count\":1,\