y\":{\"id\":\"10045225402\",\"name\":\"Twitter\"}}],\"source\":\"Twitter Web App\",\"text\":\"Unabhängig davon, wie man zum WissZeitVG steht - woher kommt der Fächer-Bias bei den Wissenschaftlern, die unter #ichbinhanna twittern? Wird in diesen Disziplinen häufiger befristet? Oder sind die Betreffenden häufiger bei Twitter? https://t.co/TIpSzPqQAO\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T09:03:48.000Z\"},{\"conversation_id\":\"1403471048415272968\",\"lang\":\"de\",\"id\":\"1403471048415272968\",\"public_metrics\":{\"retweet_count\":21,\"reply_count\":2,\"like_count\":97,\"quote_count\":0},\"author_id\":\"858060665797345280\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403326943420981253\"}],\"entities\":{\"urls\":[{\"start\":281,\"end\":304,\"url\":\"https://t.co/98o37dDTbY\",\"expanded_url\":\"https://twitter.com/alexwillich/status/1403326943420981253\",\"display_url\":\"twitter.com/alexwillich/st…\"}],\"hashtags\":[{\"start\":268,\"end\":280,\"tag\":\"IchbinHanna\"}]},\"source\":\"Twitter for iPhone\",\"text\":\"Mit das Problem ist dass wir uns überhaupt als Konkurrenz wahrnehmen. Hat bei mir auch gedauert dass aus dem Kopf zu kriegen, aber das System lebt davon dass man uns das eintrichtert. Wir brauchen Solidarität, so wie sie hier gezeigt wird - sonst ändert sich nie was. #IchbinHanna https://t.co/98o37dDTbY\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T21:55:47.000Z\"},{\"conversation_id\":\"1403760796161675269\",\"lang\":\"de\",\"id\":\"1403760796161675269\",\"public_metrics\":{\"retweet_count\":5,\"reply_count\":0,\"like_count\":11,\"quote_count\":0},\"author_id\":\"2289479446\",\"entities\":{\"urls\":[{\"start\":179,\"end\":202,\"url\":\"https://t.co/dZj9NRROK0\",\"expanded_url\":\"https://www.bdwi.de/termine/event_30518.html\",\"display_url\":\"bdwi.de/termine/event_…\",\"status\":200,\"title\":\"BdWi - Klassismus und Wissenschaft – versteckte Hintergründe einer ignorierten Diskriminierung\",\"description\":\"Bund demokratischer Wissenschaftlerinnen und Wissenschaftler (BdWi)\",\"unwound_url\":\"https://www.bdwi.de/termine/event_30518.html\"}],\"hashtags\":[{\"start\":84,\"end\":95,\"tag\":\"Klassismus\"},{\"start\":100,\"end\":113,\"tag\":\"Wissenschaft\"},{\"start\":234,\"end\":246,\"tag\":\"IchbinHanna\"},{\"start\":263,\"end\":272,\"tag\":\"firstgen\"}]},\"source\":\"Twitter for Android\",\"text\":\"+++ Einladung +++\\n\\nAnna und Martin Shakoor führen gemeinsam mit Zuzana Kobesova in \\\"#Klassismus und #Wissenschaft\\\" ein. \\uD83D\\uDCD5\\uD83E\\uDD1C\\uD83E\\uDD1B\\uD83C\\uDF93\\n\\nWann? Donnerstag, 17.6., 19 Uhr.\\nWeitere Infos hier: https://t.co/dZj9NRROK0\\n\\nInteressanr für alle, die von #IchbinHanna betroffen sind! #firstgen\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T17:07:09.000Z\"},{\"conversation_id\":\"1403747808574902276\",\"lang\":\"de\",\"id\":\"1403747808574902276\",\"public_metrics\":{\"retweet_count\":2,\"reply_count\":1,\"like_count\":26,\"quote_count\":0},\"author_id\":\"114774406\",\"source\":\"Twitter Web App\",\"entities\":{\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"}]},\"text\":\"#IchbinHanna fühlt sich an wie eine retraumatisierende Therapie. Mir fallen etliche Fälle ein, bei denen das WissZeitVG KollegInnen massiv geschadet hat. Bsp: internationale Kollegin, 50%, cutting-edge Projekt, 6 Monate Arbeit für 1 Proposal, mit wehenden Fahnen durch die\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T16:15:32.000Z\"},{\"conversation_id\":\"1403705681665011715\",\"lang\":\"de\",\"id\":\"1403705681665011715\",\"public_metrics\":{\"retweet_count\":5,\"reply_count\":1,\"like_count\":64,\"quote_count\":0},\"author_id\":\"950461149019066369\",\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":266,\"end\":278,\"tag\":\"IchbinHanna\"}]},\"text\":\"Ich bin Miriam, promovierte Soziologin, habe meine Diss im Wesentlichen während des Mutterschutz, in den Elternzeit und zum Schluss auf ALG1 fertig geschrieben. Denn die Diss. ist ja \\\"Privatvergnügen\\\". Eine Habil unter diesen Bedingungen wird's bei mir nicht geben. #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T13:28:08.000Z\"},{\"conversation_id\":\"1403393616370884612\",\"lang\":\"de\",\"id\":\"1403393616370884612\",\"public_metrics\":{\"retweet_count\":3,\"reply_count\":1,\"like_count\":29,\"quote_count\":0},\"author_id\":\"2311811718\",\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":238,\"end\":250,\"tag\":\"IchBinHanna\"}]},\"text\":\"Ich bin Svea und lehre seit 2016 an der Uni, erst Lehraufträge in Neuerer Deutscher Literaturwissenschaft, seit 2017 WiMi in Fachdidaktik Englisch (Lehrkräfteausbildung!). Nebenbei promovieren ich (erst seit 10/20 Teil meines Vertrages). #IchBinHanna aber wohl max. noch bis 09/21\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T16:48:06.000Z\"},{\"entities\":{\"mentions\":[{\"start\":134,\"end\":149,\"username\":\"SebastianKubon\"},{\"start\":151,\"end\":161,\"username\":\"AmreiBahr\"},{\"start\":168,\"end\":180,\"username\":\"DrKEichhorn\"}],\"urls\":[{\"start\":225,\"end\":248,\"url\":\"https://t.co/XmHYcM3HW7\",\"expanded_url\":\"https://twitter.com/RAltieri1987/status/1403478472777940995/photo/1\",\"display_url\":\"pic.twitter.com/XmHYcM3HW7\"}],\"hashtags\":[{\"start\":13,\"end\":21,\"tag\":\"Hashtag\"},{\"start\":22,\"end\":34,\"tag\":\"IchbinHanna\"},{\"start\":209,\"end\":215,\"tag\":\"Danke\"},{\"start\":216,\"end\":220,\"tag\":\"thx\"},{\"start\":221,\"end\":224,\"tag\":\"FF\"}]},\"conversation_id\":\"1403478472777940995\",\"lang\":\"de\",\"id\":\"1403478472777940995\",\"public_metrics\":{\"retweet_count\":7,\"reply_count\":1,\"like_count\":44,\"quote_count\":0},\"attachments\":{\"media_keys\":[\"3_1403478470672498695\"]},\"author_id\":\"2289479446\",\"source\":\"Twitter for Android\",\"text\":\"Wenn ihr den #Hashtag #IchbinHanna und das, was dort erzählt wird, gut findet, folgt mal bitte alle diesen großartigen Menschen hier:\\n@SebastianKubon \\n@AmreiBahr &amp;\\n@DrKEichhorn \\n\\nDie haben das losgetreten!#Danke #thx #FF https://t.co/XmHYcM3HW7\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T22:25:17.000Z\"},{\"conversation_id\":\"1403619667931975682\",\"lang\":\"de\",\"id\":\"1403619667931975682\",\"public_metrics\":{\"retweet_count\":6,\"reply_count\":1,\"like_count\":35,\"quote_count\":1},\"author_id\":\"2354561106\",\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchBinHanna\"}]},\"text\":\"#IchBinHanna Mal ein paar Zahlen zum Biostudium. Bis zum Diplom reduzierte sich mein Jahrgang von 120 auf 40 Personen. Den Doktor gingen ca 80% an. Ohne Doktor keine Forschungsgelder. Ca 2/3 kamen durch. Heute kenne ich eine Professorin und einen PD der im Ausland hockt. 1/2\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T07:46:21.000Z\"},{\"entities\":{\"mentions\":[{\"start\":180,\"end\":190,\"username\":\"AmreiBahr\"},{\"start\":191,\"end\":203,\"username\":\"DrKEichhorn\"},{\"start\":204,\"end\":219,\"username\":\"SebastianKubon\"}],\"urls\":[{\"start\":231,\"end\":254,\"url\":\"https://t.co/j90ommBjLk\",\"expanded_url\":\"https://zeitgeschichte-online.de/node/58477\",\"display_url\":\"zeitgeschichte-online.de/node/58477\"}],\"hashtags\":[{\"start\":129,\"end\":141,\"tag\":\"IchbinHanna\"},{\"start\":256,\"end\":284,\"tag\":\"ACertainDegreeofFlexibility\"}]},\"conversation_id\":\"1403383892296491011\",\"lang\":\"de\",\"id\":\"1403383892296491011\",\"public_metrics\":{\"retweet_count\":9,\"reply_count\":0,\"like_count\":15,\"quote_count\":0},\"author_id\":\"1113378360162496512\",\"source\":\"TweetDeck\",\"text\":\"Forschung über ALG I &amp; II finanzieren wenn nach oder zwischen den Verträgen die Forschung weiter 'läuft'? Auch davon erzählt #IchbinHanna im Video nicht. \\n\\nZum Glück schreiben @AmreiBahr @DrKEichhorn @SebastianKubon darüber: \\n\\nhttps://t.co/j90ommBjLk\\n\\n#ACertainDegreeofFlexibility\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T16:09:28.000Z\"},{\"conversation_id\":\"1403072980842954755\",\"lang\":\"de\",\"id\":\"1403072980842954755\",\"public_metrics\":{\"retweet_count\":9,\"reply_count\":1,\"like_count\":42,\"quote_count\":1},\"attachments\":{\"media_keys\":[\"3_1403072929697517571\"]},\"author_id\":\"28532853\",\"entities\":{\"urls\":[{\"start\":154,\"end\":177,\"url\":\"https://t.co/oKkzrXz21c\",\"expanded_url\":\"https://twitter.com/techsoz/status/1403072980842954755/photo/1\",\"display_url\":\"pic.twitter.com/oKkzrXz21c\"}],\"hashtags\":[{\"start\":141,\"end\":153,\"tag\":\"ichbinhanna\"}]},\"source\":\"Twitter Web App\",\"text\":\"Kann bitte jemand mal alle Wikipediaseiten dt. Soziolog*innen umschreiben in sowas in der Art? (beliebig rausgegriffen, hier mal Dahrendorf) #ichbinhanna https://t.co/oKkzrXz21c\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-10T19:34:01.000Z\"},{\"in_reply_to_user_id\":\"1132055796571877376\",\"conversation_id\":\"1403623179315302401\",\"lang\":\"de\",\"id\":\"1403755370783326214\",\"public_metrics\":{\"retweet_count\":1,\"reply_count\":1,\"like_count\":9,\"quote_count\":0},\"author_id\":\"1132055796571877376\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1403623179315302401\"}],\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":202,\"end\":214,\"tag\":\"IchbinHanna\"},{\"start\":215,\"end\":228,\"tag\":\"Mansplaining\"},{\"start\":229,\"end\":253,\"tag\":\"FrauenInDerWissenschaft\"},{\"start\":254,\"end\":273,\"tag\":\"WomenAlsoKnowStuff\"}]},\"text\":\"Einfach herrlich, wie hier wieder die anonymen Dudes aus ihren Löchern gekrochen kommen und meinen, völlig am Thema des Tweets vorbei  Wissenschaftlerinnen ihr Leben und ihre Arbeit erklären zu müssen.\\n#IchbinHanna #Mansplaining #FrauenInDerWissenschaft #WomenAlsoKnowStuff\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T16:45:35.000Z\"},{\"conversation_id\":\"1403735804787232775\",\"lang\":\"de\",\"id\":\"1403735804787232775\",\"public_metrics\":{\"retweet_count\":7,\"reply_count\":0,\"like_count\":11,\"quote_count\":1},\"author_id\":\"1352980323521470467\",\"entities\":{\"urls\":[{\"start\":135,\"end\":158,\"url\":\"https://t.co/h0CBlzSjZQ\",\"expanded_url\":\"https://ueberstrom.net/2021/06/12/ich-bin-kathrin-ich-bin-biologin-und-ichbinhanna-eine-prekaere-verstopfung-des-wissenschaftssystems/\",\"display_url\":\"ueberstrom.net/2021/06/12/ich…\",\"images\":[{\"url\":\"https://pbs.twimg.com/news_img/1403735805147897859/mNAe7Ptd?format=jpg&name=orig\",\"width\":940,\"height\":788},{\"url\":\"https://pbs.twimg.com/news_img/1403735805147897859/mNAe7Ptd?format=jpg&name=150x150\",\"width\":150,\"height\":150}],\"status\":200,\"title\":\"Ich bin Kathrin. Ich bin Biologin. Und #IchBinHanna. Eine prekäre „Verstopfung“ des Wissenschaftssystems? - ÜBER/STROM\",\"description\":\"2018 stellte das Bundesministerium für Bildung und Forschung (BMBF) ein „Erklärvideo“ zum Wissenschaftszeitvertragsgesetz ins Internet.…\",\"unwound_url\":\"http://ueberstrom.net/2021/06/12/ich-bin-kathrin-ich-bin-biologin-und-ichbinhanna-eine-prekaere-verstopfung-des-wissenschaftssystems/\"}],\"hashtags\":[{\"start\":5,\"end\":17,\"tag\":\"IchBinHanna\"}]},\"source\":\"Twitter Web App\",\"text\":\"Dass #IchBinHanna genauso für Naturwissenschaften gilt, beschreibt die Biologin und Autorin Dr. Kathrin Marter sehr eindringlich hier: https://t.co/h0CBlzSjZQ\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T15:27:50.000Z\"},{\"conversation_id\":\"1403708075685695489\",\"lang\":\"de\",\"id\":\"1403708075685695489\",\"public_metrics\":{\"retweet_count\":4,\"reply_count\":2,\"like_count\":26,\"quote_count\":0},\"author_id\":\"114774406\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403701429659897862\"}],\"entities\":{\"urls\":[{\"start\":130,\"end\":153,\"url\":\"https://t.co/hTxfIStK3g\",\"expanded_url\":\"https://twitter.com/Laura_R_Klein/status/1403701429659897862\",\"display_url\":\"twitter.com/Laura_R_Klein/…\"}],\"hashtags\":[{\"start\":7,\"end\":16,\"tag\":\"firstgen\"},{\"start\":117,\"end\":129,\"tag\":\"IchbinHanna\"}]},\"source\":\"Twitter Web App\",\"text\":\"Vielen #firstgen wird nahegelegt, die soziale Herkunft vor allem in Bewerbungssituationen lieber nicht offenzulegen. #IchbinHanna https://t.co/hTxfIStK3g\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T13:37:39.000Z\"},{\"conversation_id\":\"1403748396976967684\",\"lang\":\"de\",\"id\":\"1403748396976967684\",\"public_metrics\":{\"retweet_count\":2,\"reply_count\":1,\"like_count\":13,\"quote_count\":0},\"author_id\":\"730098730943324162\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403298100886835200\"}],\"entities\":{\"urls\":[{\"start\":26,\"end\":49,\"url\":\"https://t.co/RVBkWJX8De\",\"expanded_url\":\"https://twitter.com/DanielaHaarmann/status/1403298100886835200\",\"display_url\":\"twitter.com/DanielaHaarman…\"}],\"hashtags\":[{\"start\":0,\"end\":12,\"tag\":\"IchbinHanna\"}]},\"source\":\"Twitter Web App\",\"text\":\"#IchbinHanna (Österreich) https://t.co/RVBkWJX8De\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T16:17:52.000Z\"},{\"conversation_id\":\"1403238905051332609\",\"lang\":\"de\",\"id\":\"1403238905051332609\",\"public_metrics\":{\"retweet_count\":281,\"reply_count\":35,\"like_count\":2834,\"quote_count\":18},\"author_id\":\"1002645247388774400\",\"source\":\"Twitter for iPhone\",\"text\":\"Ich bin Reyhan, 39, Sprach-, Migrations- &amp; Rassismusforscherin. Ich hatte noch nie ne Uni-Stelle, finanzierte meine Promotion, Postdoc (&amp; jetzige Habilitation) mit selbst beantragten Stipendien. Forscher:innen of Color aus nicht-akademisierten Familien haben’s in der Fuckademia\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T06:33:20.000Z\"},{\"entities\":{\"mentions\":[{\"start\":120,\"end\":136,\"username\":\"eliserichternet\"},{\"start\":137,\"end\":151,\"username\":\"IGLektorInnen\"}],\"urls\":[{\"sta