1877376\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403290368830017538\"}],\"entities\":{\"urls\":[{\"start\":271,\"end\":294,\"url\":\"https://t.co/2AnSa66zTW\",\"expanded_url\":\"https://twitter.com/MsOeming/status/1403290368830017538\",\"display_url\":\"twitter.com/MsOeming/statu…\"}],\"hashtags\":[{\"start\":0,\"end\":10,\"tag\":\"Unbezahlt\"},{\"start\":212,\"end\":223,\"tag\":\"Ausbeutung\"},{\"start\":224,\"end\":236,\"tag\":\"IchbinHanna\"},{\"start\":237,\"end\":252,\"tag\":\"faireBezahlung\"},{\"start\":253,\"end\":268,\"tag\":\"95vsWissZeitVG\"}]},\"source\":\"Twitter for Android\",\"text\":\"#Unbezahlt|e Mehrarbeit als Standard in der Wissenschaft, und Konferenzreisen, die von Vorgesetzten als Freizeitvergnügen angesehen werden und die aus eigener Tasche bezahlt werden müssen, müssen ein Ende haben!\\n#Ausbeutung #IchbinHanna #faireBezahlung #95vsWissZeitVG # https://t.co/2AnSa66zTW\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-12T08:00:18.000Z\"},{\"conversation_id\":\"1403242613591916545\",\"lang\":\"de\",\"id\":\"1403242613591916545\",\"public_metrics\":{\"retweet_count\":14,\"reply_count\":1,\"like_count\":88,\"quote_count\":0},\"author_id\":\"30866639\",\"source\":\"Twitter for Android\",\"entities\":{\"hashtags\":[{\"start\":240,\"end\":252,\"tag\":\"IchbinHanna\"}]},\"text\":\"Ich bin Stefan, 36, PostDoc, Regionalhistoriker mit Leib und Seele, aber wenn ich an der Uni bleiben möchte, muss ich realistisch betrachtet entweder meine Familie alle paar Jahre entwurzeln oder bin ständig abwesend. Uni essen Familie auf #IchbinHanna\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-11T06:48:04.000Z\"},{\"conversation_id\":\"1403421156485611528\",\"lang\":\"de\",\"id\":\"1403421156485611528\",\"public_metrics\":{\"retweet_count\":6,\"reply_count\":1,\"like_count\":39,\"quote_count\":0},\"author_id\":\"2394794221\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1403418934376898562\"}],\"entities\":{\"urls\":[{\"start\":279,